(13775, 1252, '_toh_madeinamerica', 'There are more exciting things to see when you travel through the Black Hills. Take time to see Mount Rushmore and Crazy Horse monument. Ride through Spearfish Canyon. See Fort Meade. Camp at Custer State Park where you can drive through the famous Iron Mountain Road Tunnel and Needles Highway. Stop in the middle of the road to allow free roaming buffalo to cross your path in Custer State Park and Wind Cave National Park. Whatever direction you take, youâll be sure to leave with a lot of memories.'),
