(14160, 1287, '_toh_madeinamerica', 'Woodstock is a great little farm town and county seat. You may remember the film, âGroundhog Dayâ starring Bill Murray. It was filmed here. A restored opera house shares the town square with the restored courthouse and jail. There are several very good restaurants around the town square, particularly the Public House in the old jail building. The owner of Public House is also a custom bike builder.'),
