(14171, 1288, '_toh_madeinamerica', 'Nearby in Cedar Lake, is a museum worth visiting that houses many interesting exhibits of Cedar Lake and the surrounding area. Included among them are the ice industry which flourished in the late 1800s and early 1900s, and several period rooms depict the lifestyle of the early century. The museum maintains a 1920s flavor in keeping with Cedar Lake\'s tradition as a resort destination for Chicago\'s high society during the Prohibition era.'),
