(14182, 1289, '_toh_madeinamerica', 'There is a Museum that is located in a nice quiet location, the tiny town of Dana, Indiana. The ride to Dana takes you through corn fields, passing by the old Phillips Covered Bridge. Ernie Pyle\'s house sits on a corner. Next to the house are two quonset huts with WWII memorabilia and audio recordings of some of Ernie\'s writings. A short film at the entry of the quonsets is excellent. After the quonsets, a volunteer gives a tour of the 1800\'s house that Ernie grew up in. Admission is $5. https://bit.ly/2CgRequ'),
