(14336, 1303, '_toh_madeinamerica', 'Kinsley earned the name \"Midway USA\" by being exactly 1,561 miles from San Francisco to the west and 1,561 miles to New York in the east, inspiring a 1939 Saturday Evening Post cover showing two cars, starting in Kinsley and going in opposite directions, both bearing a sign saying, \"World\'s Fair or Bust.\" In 1939, there were two \"World\'s Fairs\": an eponymous one in New York, and the Golden Gate Exposition in San Francisco. The sign is in a nice park just down the street, along with a nice locomotive.'),
