(14402, 1309, '_toh_madeinamerica', 'Made In America: You can visit the Three Forks Historical Center, a neat museum located at CS-1065. The recently added Veteran Hall is probably the most impressive section of the museum where youâll find a nice combination of graphics, wartime posters, photos, badges and even uniforms. Each uniform has a name attached to it and was donated by that solders family, bringing home the reality of war. Thereâs also a caboose for those collecting AULDR sites. Itâs well worth a stop and converse with the local folks.'),
