(15733, 1430, '_toh_madeinamerica', 'While in the area, you might as well take a spin down Old Liberty Road to the north of here, running from Asheboro to Liberty. It may not be in the NC mountains, but it still has lots of elevation changes, with a number of curves that can sneak up on you, as well as several one-lane bridges. Whether you choose to take it into town, or out of town (or both), it is an excellent motorcycle road.'),
