(15788, 1435, '_toh_madeinamerica', 'The historic Robinson`s Cave is just a few blocks down the street (39.577883, -82.238833) where groups of Hocking Valley coal miners could meet in secret beginning in the 1870s. Christopher Evans, a well-known union organizer, used the cave to lead miners throughout the long Hocking Valley Coal Strike of 1884-1885. Robinson\'s Cave is referred to as the secret birthplace of the United Mine Workers.'),
