(15799, 1436, '_toh_madeinamerica', 'Itâs a 30 minute ride northeast to Hillbilly Hot Dog, located at 6951 Ohio River Rd, Lesage, West Virginia. They were made Famous by Diners, Drive Ins, and Dives and deservedly so. Itâs a great lunch stop where you can eat in a bus, get married in a chapel, and get the Weenie song sung to you for a $1 tip. Bring your own souvenir (poker chip?) to leave hanging on the grounds, and be ready to spend some time here viewing all they have to offer. http://www.hillbillyhotdogs.com/ Part of the RTE-USA Challenge!'),
