(15931, 1448, '_toh_madeinamerica', 'Brookings is a beautiful coastal town and highly sought out by retirees, as it is only six miles from the California state line. Lily bulbs are grown in the 12 miles between Brookings and Smith River, California and represent 100% of the crop for all of North America, bringing economic stability to the region. Fishing, both sport and pleasure, produce some great catches that many restaurants in the area highlight regularly. You are currently traveling on Highway 101 which traverses from Canada to Mexico so enjoy the ride. Be sure to check California for what could be the closest TOH site.'),
