(16140, 1467, '_toh_madeinamerica', 'South Carolina Military Museum is only 18 miles away. Located in the capital city of Columbia, the South Carolina Military Museum is one of the largest National Guard museums in the country. The mission is to honor and chronicle the South Carolina citizen soldier and this State\'s martial tradition from its colonial founding in 1670 to present-day operations. Featuring an impressive collection of artifacts, displays and exhibits, the museum tells the story of the South Carolina militia, its evolution into the National Guard, and its important role today as a force multiplier for the United States Army and Air Force.'),
