(16569, 1506, '_toh_madeinamerica', 'Paw Paw was incorporated in 1891 and named for the Paw Paw fruit that grew abundantly in the area at the time. Just north of town is the Paw Paw Tunnel, an impressive piece of engineering built to allow the C&O canal get around the mountain and avoid the series of curves in the Potomac River. The tunnel is now part of the Chesapeake and Ohio Canal National Historical Park.'),
