(16591, 1508, '_toh_madeinamerica', 'Whether or not youâre hunting RTE-USA sites, Country Club Bakery, creator of the Pepperoni Roll, is 12 miles away, in Fairmont at 1211 Country Club Rd. If youâve never had a West Virginia Pepperoni Roll, ya gotta try one. Itâs a thing. Imagine a warm, soft, homemade, mouth watering, large roll packed with zesty slices of pepperoni. Thatâs just the beginning; now add smooth provolone cheese or spicy hot pepper cheese, and you have a quick, easy sandwich thatâs out of this world!'),
