(16701, 1518, '_toh_madeinamerica', 'Deaver is at the junction of Hwys. 310 and 114 and has a population of 178. One restaurant, M Sisters LLC, in the former Trailways building along Hwy. 310 but hours of operation are limited. No gas services available so make sure you are filled up before you head this way.'),
