(16723, 1520, '_toh_madeinamerica', 'Greybull on Route 14, 16 and 20 between Yellowstone and the Black Hills. Greybull is a western town along the Bighorn River which allows for numerous water activities such as boating and fishing. The Greybull Museum is small but free and has numerous artifacts from wild west days and even some fossils from the local area.'),
