(18909, 1631, '_toh_madeinamerica', 'Grand Isle is Louisianaâs only inhabited barrier island. As an early home to Native Americans, then plantations, and later the pirate Jean Lafitte, the island holds an important place in the history of Louisiana. But Grand Isle is much more than just history, itâs been home to locals for hundreds of years, people who have lived off the land and water raising their families and creating a unique culture. Today, the island is home to around 1,500 locals, who make a living from the seafood and oil industries. More than 12,000 tourists visit the island annually to participate in fishing rodeos and enjoy the wide-open beaches and countless bird sightings.'),
