(18931, 1633, '_toh_madeinamerica', 'Avoyelles Parish, in central Louisiana, takes its name from Avoyels Indians, and the locals commemorate their Native American as well as French Creole heritage. The abundant wildlife and many waterways make this a hunting, fishing and birdwatching paradise, year-round. Casino action boasts a different kind of wildlife, and a variety of accommodations make for a comfortable stay as you explore.'),
