(18953, 1635, '_toh_madeinamerica', 'Winnsboro is a small city and the parish seat of Franklin Parish. A regional commerce âhubâ for surrounding communities both within and without Franklin Parish, it is the heart of âCotton Countryâ in northeast Louisiana , and a place where âcountry livingâ is more than just a metaphor. It also displays the largest US flag in the state. The parishâs quiet country roads with cattle grazing in bordering fields are peaceful avenues into rural Louisiana.'),
