(19657, 1699, '_toh_madeinamerica', 'One of the most famous BBQ restaurants, in a state full of famous BBQ restaurants, can be found in Ayden. That restaurant is Skylight Inn BBQ, located 1.2 miles from the memorial, at 4618 S Lee St. Skylight Inn (also known as Pete Jonesâ BBQ) has been cooking whole hogs over wood since 1947 and is one of 20 restaurants on the North Carolina Barbecue Societyâs Historic BBQ TrailÂ®. Skylight Inn was awarded the prestigious James Beard \"America\'s Classics\" Award, considered by many to be âthe Oscars for culinary arts.â Donât pass up the opportunity to stop in for some mouthwatering BBQ from Skylight Inn.'),
