(19723, 1705, '_toh_madeinamerica', 'You can always find a BBQ restaurant in North Carolina, but this place is unique. Mission BBQ is a chain that strives every day to remind everyone what makes our country greatâits heroes. At Mission BBQ, they also give back by supporting local and national charities, including USO, Special Operations Warrior Foundation, Semper Fi Fund, Navy Seal Foundation, Wreaths Across America, Honor Flight America, and National Fallen Firefighters Foundation. If you stop by for lunch, you might even get to witness (and participate in) the daily salute to the Stars & Stripes. Every day at noon, the National Anthem is played as employees lead the salute. Mission BBQ, 351 S College Rd #22/23.'),
