(19888, 1720, '_toh_madeinamerica', 'Baker City started in 1862 for gold mining in the nearby area. It remained a small western town, now with farming and cattle ranching sustaining it. Many great motorcycle roads cross the area and give you the chance to enjoy the mountains and some great twisties or Hwy. 84 for quick access to your next TOH site.'),
