(19910, 1722, '_toh_madeinamerica', 'Estacada takes you from the busy rush of big cities back to the quiet delights of small town America. Stop to enjoy the river or the birds along the way while visiting Bagby Hot Springs just one hour up the road. Individual tubs, including whiskey barrels, allow you that full relaxation from your long and hot (or maybe wet) ride to get here. Clothing optional. Find out more at https://soakoregon.com/bagby-hot-springs/'),
