(19921, 1723, '_toh_madeinamerica', 'The world-renowned Evergreen Aviation and Space Museum is just seven minutes east of here. The Spruce Goose, a SR-71 Blackbird, and the largest collection of Vietnam-era military aircraft is on display. A $12 admission ticket ($27 value) *may* be available here: https://bit.ly/2LVTXKk. If not available for some reason, ask for AAA and veterans discounts at the door.'),
