(20031, 1733, '_toh_madeinamerica', 'This is rural Pennsylvania at its finest. Small towns. Friendly folks. Beautiful scenery. Fantastic motorcycle roads. This county is named Forest County for a reason. There are more trees in the county than people, and lots of cover for the deer. Enjoy your ride but stay alert for deer and other wildlife as you ride.'),
