(20042, 1734, '_toh_madeinamerica', 'Palmetto Distillery, in the heart of Anderson at 200 W Benson St., is the first micro-distillery in South Carolina to produce Palmetto Moonshine, South Carolinaâs first legal moonshine, and Palmetto Whiskey, South Carolinaâs Most Awarded Craft Whiskey. They also have the distinction of being the South Carolina Whiskey Distillery of the Year, as voted by the New York International Spirits Competition. All guests over 21 years of age are invited for a free tour of the craft whiskey and moonshine distillery.'),
