(20053, 1735, '_toh_madeinamerica', 'Within sight of the memorial is the Lee County Veterans Museum, located next to the South Carolina Cotton Museum at 121 W. Cedar Lane. The exhibits trace the history of American conflicts with artifacts and military memorabilia provided by Lee County veterans and families. A series of exhibits tell the history of six branches of the uniformed service, including a permanent exhibit honoring Lee Countyâs Medal of Honor recipient, James Davison Heriot. Special remembrances of deceased veterans are represented in the Lest We Forget section. The Lee County Veterans Museum provides quarters for the American Legion Post 29 and Veterans of Foreign Wars Post 3096. Museum hours: Monday-Friday 10am-4:30pm, Saturday 10am-4pm.'),
