(20548, 1780, '_toh_madeinamerica', 'The city of Hot Springs was developed in the 1880s as a resort community, with visitors drawn to the restorative and curative properties of its mineral springs. In 1902, local business leaders lobbied Congress to build a facility as a National Home for Disabled Volunteer Soldiers (NHDVS). In 1907, the Battle Mountain Sanitarium (500 N 5th St.) opened for its first patients, and in 1930, it was handed over to the Veterans Administration as a more general-purpose medical facility. Pay a visit if you can.'),
