(21208, 1840, '_toh_madeinamerica', 'Encampment is a small Wyoming town along Hwy. 70 that was first inhabited by French-Canadian trappers in the 1800s. In 1897, copper was discovered in the mountains and growth followed. A tramway ran from the mine to Encampment a distance of 16 miles to bring the copper to the smelter. Part of the tramway is still on display at the Encampment Museum, one block south from the memorial. The museum is free and a must see if interested in the rich history of this area. Only 10 towns exist in the whole of Carbon County.'),
