(21230, 1842, '_toh_madeinamerica', 'Newcastle is an 1880âs town that has had many ups and several downs over the years. Much of the history is included in the Anna Miller Museum, which is just outside the gate of the cemetery in several 1889 buildings and is free for the visit. Newcastle has many restaurants for all types of appetites so enjoy a stop before heading out of town.'),
