(21241, 1843, '_toh_madeinamerica', 'Pinedale, is a mountain town on the Centennial Scenic Byway at the base of the majestic Wind River Mountain Range. Wildlife outnumber residents ten-fold and animals are commonly seen any day of the year. There are resident moose found in town parks, and mule deer cautiously make their way across streets and driveways. Mountain lions and bobcats have been spotted sunning on rocks, and gray wolves and elk herds can be seen loping alongside fences near wilderness areas.'),
