(16, '2019-04-02 04:27:55', '1', '{\n    \"meta\": {\n        \"fileName\": \"Tour of Honor Bonus Listing\",\n        \"version\": \"19.3.4\"\n    },\n    \"bonuses\": [\n        {\n            \"bonusCode\": \"AK4\",\n            \"category\": \"TOH\",\n            \"name\": \"Alaska Siberia WWII Memorial\",\n            \"value\": 1,\n            \"address\": \"360 Noble St.\",\n            \"city\": \"Fairbanks\",\n            \"state\": \"AK\",\n            \"GPS\": \"64.845371,-147.717211\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Pikeâs Waterfront Lodge is an only-in-Alaska hotel on the banks of the China River. Nice and reasonable priced. https://goo.gl/t9r5b8\",\n            \"imageName\": \"2019ak4.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK5\",\n            \"category\": \"TOH\",\n            \"name\": \"Lost Seafarers Memorial\",\n            \"value\": 1,\n            \"address\": \"End of Homer Spit\",\n            \"city\": \"Homer\",\n            \"state\": \"AK\",\n            \"GPS\": \"59.600677,-151.418815\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Located in old town Homer, the biker-friendly Driftwood Inn is recommended. Clean, reasonably priced and a variety of room types from under $100 to over $200+. H.O.G. Anchorage has a couple runs to Homer every year and the Driftwood puts out âHarley Parking Onlyâ signs during those times. Right on the water, it also has great views. In old town Homer.Â https://goo.gl/adfjfV\",\n            \"imageName\": \"2019ak5.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK6\",\n            \"category\": \"TOH\",\n            \"name\": \"Alaska Territorial Guard\",\n            \"value\": 1,\n            \"address\": \"Nenana, Alaska\",\n            \"city\": \"Nenana\",\n            \"state\": \"AK\",\n            \"GPS\": \"64.560330,Â -149.096208\",\n            \"Access\": \"24/7 unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Keep an eye out for the black and white Tripods around town, part of a popular lottery game called âThe Nenana Ice Classic.â Every winter, since 1917, townspeople take one out onto the frozen Nenana River. When the Tripod moves, signifying spring thaw, a lucky winner gets $300,000 cash. Thereâs also Mears Memorial Bridge.\",\n            \"imageName\": \"2019ak6.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK7\",\n            \"category\": \"TOH\",\n            \"name\": \"Great Race of Mercy 1925 Serum Run to Nome\",\n            \"value\": 1,\n            \"address\": \"AKA Iditarod Trail Race\",\n            \"city\": \"Seward\",\n            \"state\": \"AK\",\n            \"GPS\": \"60.100467,-149.439511\",\n            \"Access\": \"Data not availalbe\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Breeze Inn is a clean, biker friendly hotel with Seward Harbor view rooms in one of their buildings if you so desire. Reasonably priced, quite large rooms. They also have security cameras watching the parking lot. https://goo.gl/YuwSC5\",\n            \"imageName\": \"2019ak7.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS1\",\n            \"category\": \"Hueys\",\n            \"name\": \"66-17044 UH-1 - Wasilla\",\n            \"value\": 1,\n            \"address\": \"3800 W Museum Dr\",\n            \"city\": \"Wasilla\",\n            \"state\": \"AK\",\n            \"GPS\": \"61.576867, -149.546148\",\n            \"Access\": \"\",\n            \"flavor\": \"Museum of Alaska Transportation and Industry\\nhttp://www.museumofalaska.org\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys1.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS2\",\n            \"category\": \"Hueys\",\n            \"name\": \"65-12849 UH-1 - Anchorage\",\n            \"value\": 1,\n            \"address\": \"4721 Aircraft Dr\",\n            \"city\": \"Anchorage*\",\n            \"state\": \"AK\",\n            \"GPS\": \"61.179111, -149.972604\",\n            \"Access\": \"\",\n            \"flavor\": \"Alaska Aviation Heritage Museum\\nhttp://www.alaskaairmuseum.org/\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys2.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS3\",\n            \"category\": \"Hueys\",\n            \"name\": \"66-00934 UH-1 - Fairbanks\",\n            \"value\": 1,\n            \"address\": \"2300 Airport Way\",\n            \"city\": \"Fairbanks*\",\n            \"state\": \"AK\",\n            \"GPS\": \"64.839445, -147.774935\",\n            \"Access\": \"\",\n            \"flavor\": \"Pioneer Air Museum\\nhttp://www.pioneerairmuseum.org/\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys3.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL1\",\n            \"category\": \"TOH\",\n            \"name\": \"Fire Fighters Memorial\",\n            \"value\": 1,\n            \"address\": \"Athens Square\",\n            \"city\": \"Athens\",\n            \"state\": \"AL\",\n            \"GPS\": \"34.803167, -86.971900\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre looking for a good burger, try Dubs Burgers (402 S Jefferson St.) just a few blocks south of the memorial. Or for BBQ, try 306 Barbecue: www.306BBQ.com/hwy72/\",\n            \"imageName\": \"2019al1.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL2\",\n            \"category\": \"TOH\",\n            \"name\": \"WWII Memorial\",\n            \"value\": 1,\n            \"address\": \"Nr. 223 E Broad St.\",\n            \"city\": \"Eufaula\",\n            \"state\": \"AL\",\n            \"GPS\": \"31.893017, -85.142868\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Eufala bills itself as the âBig Bass Capital of the World,â so if you want a photo of yourself with a big-un, âManny, the 12-Foot-Tall Fishâ is just east of the memorial at 404 E Broad St.\",\n            \"imageName\": \"2019al2.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL3\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 199\",\n            \"value\": 1,\n            \"address\": \"700 S Mobile St.\",\n            \"city\": \"Fairhope\",\n            \"state\": \"AL\",\n            \"GPS\": \"30.513601, -87.918538\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019al3.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL4\",\n            \"category\": \"TOH\",\n            \"name\": \"Fallen Officers Memorial\",\n            \"value\": 1,\n            \"address\": \"113 Temple Ave. N\",\n            \"city\": \"Fayette\",\n            \"state\": \"AL\",\n            \"GPS\": \"33.684767, -87.831167\",\n            \"Access\": \"24/7, unrestricted. It may be tempting, but donât ride on the sidewalk.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For real southern BBQ, try Samâs Smoke House (460 Columbus St E.), just a couple of blocks east of the memorial.\",\n            \"imageName\": \"2019al4.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL5\",\n            \"category\": \"TOH\",\n            \"name\": \"Law Enforcement Memorial\",\n            \"value\": 1,\n            \"address\": \"800 Forrest Ave.\",\n            \"city\": \"Gadsden\",\n            \"state\": \"AL\",\n            \"GPS\": \"34.015280, -86.011750\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre looking for something COOL to eat, try Frios Gourmet Pops a few blocks east of here at 544 Broad St. #1 Dessert in Gadsden according to Tripadvisor.com\",\n            \"imageName\": \"2019al5.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL6\",\n            \"category\": \"TOH\",\n            \"name\": \"Afghanistan-Iraq War Memorial\",\n            \"value\": 1,\n            \"address\": \"11th Ave. and 20th St.\",\n            \"city\": \"Haleyville\",\n            \"state\": \"AL\",\n            \"GPS\": \"34.226450, -87.621200\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019al6.jpg\"\n        },\n        {\n            \"bonusCode\": \"AL7\",\n            \"category\": \"TOH\",\n            \"name\": \"Remembering the Assaults on Our Country 9/11\",\n            \"value\": 1,\n            \"address\": \"100 E. Commerce St.\",\n            \"city\": \"Wetumpka\",\n            \"state\": \"AL\",\n            \"GPS\": \"32.536983, -86.204767\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If you like hot dogs, give Grumpy Dog a try, just one block north of the memorial at 200 E Bridge St.\",\n            \"imageName\": \"2019al7.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Jack Henry Post 1\",\n            \"value\": 1,\n            \"address\": \"Anchorage, Alaska\",\n            \"city\": \"Anchorage, AL Post\",\n            \"state\": \"AL\",\n            \"GPS\": \"61.198649, -149.899567\",\n            \"Access\": \"24/7, unrestricted.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019ak1.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK2\",\n            \"category\": \"TOH\",\n            \"name\": \"Anchorage, Alaska\",\n            \"value\": 1,\n            \"address\": \"Rememberance Circle off Merrill Field Dr.\",\n            \"city\": \"Anchorage\",\n            \"state\": \"AL\",\n            \"GPS\": \"61.208368,-149.841395\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"You want to make hotel reservations in Anchorage as far ahead as possible. Smaller towns and villages not so much, but the farther ahead you plan, the better prices you will normally receive. TripAdvisor.com is your friend in Alaska.\",\n            \"imageName\": \"2019ak2.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Denali Park\",\n            \"city\": \"Byer\'s Lake]]>\",\n            \"state\": \"AL\",\n            \"GPS\": \"62.746286,-150.128109\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Denali State Park is 325,240 acres, almost one-half the size of Rhode Island. The park provides visitors with a great variety of recreational opportunities, ranging from roadside camping to extreme wilderness exploration.\",\n            \"imageName\": \"2019ak3.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS1\",\n            \"category\": \"War Dogs\",\n            \"name\": \"War Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"2703 Battleship ParkwayÂ \",\n            \"city\": \"Mobile\",\n            \"state\": \"AL\",\n            \"GPS\": \"30.683276, -88