           \"city\": \"Oakley\",\n            \"state\": \"ID\",\n            \"GPS\": \"Data not available\",\n            \"Access\": \"Data not availalbe\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 http://www.tourofhonor.com/pages/rules.html#rules57 for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The town of Oakley is recognized worldwide for its Middle Mountain quarries of Rocky Mountain quartzite building stone known as \\\"Oakley Stone.\\\" Quarry operators ship out thousands of tons a month to locations around the globe. It is visited for historic Victorian homes and its annual Pioneer Days celebrations in Mid-July.\",\n            \"imageName\": \"2019id3.jpg\"\n        },\n        {\n            \"bonusCode\": \"ID4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Old Fort Boise Park\",\n            \"city\": \"Parma\",\n            \"state\": \"ID\",\n            \"GPS\": \"43.780329, -116.932882\",\n            \"Access\": \"Data not availalbe\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 http://www.tourofhonor.com/pages/rules.html#rules57 for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Boys Best Burgers is adjacent to the park as is Apple Lucyâs Restaurant. The park has restroom facilities, camping and an ample area to park for the photos. Thereâs a travel center just south and east from the memorial and a Chevron Station at the north end of town.\",\n            \"imageName\": \"2019id4.jpg\"\n        },\n       