r to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just down river from Chillicothe is East Peoria and the Burger Barge listed on the RTE-USA Challenge list. 1401 N Main St.\",\n            \"imageName\": \"2019il2.jpg\"\n        },\n        {\n            \"bonusCode\": \"IL3\",\n            \"category\": \"TOH\",\n            \"name\": \"Liberty Park Memorial\",\n            \"value\": 1,\n            \"address\": \"West Virginia St. and Park St.\",\n            \"city\": \"Dieterich\",\n            \"state\": \"IL\",\n            \"GPS\": \"39.059197, -88.382948\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Best bet on eats is just up the road in Effingham.\",\n            \"imageName\": \"2019il3.jpg\"\n        },\n        {\n            \"bonusCode\": \"IL4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Chittenden Park\",\n            \"city\": \"Mendon\",\n            \"state\": \"IL\",\n            \"GPS\": \"40.088962, -91.284144\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The best food can be had in nearby Quincy where there are quite a few good spots, including State Street Bar & Grill at 1638 State St., Quincy, a sports bar with a renowned menu. Itâs also part of the RTE-USA Challenge