           \"city\": \"Woodstock\",\n            \"state\": \"IL\",\n            \"GPS\": \"42.288898, -88.432242\",\n            \"Access\": \"24/7 to the Veterans Memorial. Dealership hours for Hall of Honor.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Woodstock is a great little farm town and county seat. You may remember the film, âGroundhog Dayâ starring Bill Murray. It was filmed here. A restored opera house shares the town square with the restored courthouse and jail. There are several very good restaurants around the town square, particularly the Public House in the old jail building. The owner of Public House is also a custom bike builder.\",\n            \"imageName\": \"2019il7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS31\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Vietnam War Dog Memorial - RELOCATED - SEE PEORIA, IL\",\n            \"value\": 1,\n            \"address\": \"3826 Taylor Rd.\",\n            \"city\": \"Hanna City\",\n            \"state\": \"IL\",\n            \"GPS\": \"40.734172, -89.742735\",\n            \"Access\": \"\",\n            \"flavor\": \"Wild Life Prairie Park - Admission Fee\\nhttps://goo.gl/fbokCr\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs31.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS32\",\n            \"category\": \"War Dogs\",\n            \"name\": \"War Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"301 Irving Park Rd.\",\n            \"city\": \"Streamwood\",\n            \"state\": \"IL\",\n            \"GPS\": \"42.010835, -88.172455\",\n            \"Access\": \"\",\n            \"flavor\": \"Veterans Memorial at Streamwood Village Hall\\nhttp