    \"bonusCode\": \"PARKS87\",\n            \"category\": \"Parks\",\n            \"name\": \"Lincoln Home NHS\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Springfield\",\n            \"state\": \"IL\",\n            \"GPS\": \"39.797484,-89.646324\",\n            \"Access\": \"\",\n            \"flavor\": \"NHS\\nhttps://www.nps.gov/liho/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks87.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN1\",\n            \"category\": \"TOH\",\n            \"name\": \"Korean Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Grand Blvd. and E 145th Ave.\",\n            \"city\": \"Crown Point\",\n            \"state\": \"IN\",\n            \"GPS\": \"41.355120, -87.259267\",\n            \"Access\": \"24/7, a couple hundred feet of walking\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Nearby in Cedar Lake, is a museum worth visiting that houses many interesting exhibits of Cedar Lake and the surrounding area. Included among them are the ice industry which flourished in the late 1800s and early 1900s, and several period rooms depict the lifestyle of the early century. The museum maintains a 1920s flavor in keeping with Cedar Lake\'s tradition as a resort destination for Chicago\'s high society during the Prohibition era.\",\n            \"imageName\": \"2019in1.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN2\",\n            \"category\": \"TOH\",\n            \"name\": \"Ernie Pyle Memorial\",\n            \"value\": 1,\n            \"address\": \"North side of US36 2.2 miles east of US36 and Hwy 71 intersection\",\n            \"city\": \"Dana\",\n            \"state\": \"IN\",\n            \"GPS\": \"39.797054, -87.453102\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There is a Museum that is located in a nice quiet location, the tiny town of Dana, Indiana. The ride to Dana takes you through corn fields, passing by the old Phillips Covered Bridge. Ernie Pyle\'s house sits on a corner. Next to the house are two quonset huts with WWII memorabilia and audio recordings of some of Ernie\'s writings. A short film at the entry of the quonsets is excellent. After the quonsets, a volunteer gives a tour of the 1800\'s house that Ernie grew up in. Admission is $5. https://bit.ly/2CgRequ\",\n            \"imageName\": \"2019in2.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN3\",\n            \"category\": \"TOH\",\n            \"name\": \"Memorial Park\",\n            \"value\": 1,\n            \"address\": \"Bartlett St. and W Park Dr.\",\n            \"city\": \"Huntington\",\n            \"state\": \"IN\",\n            \"GPS\": \"40.878568, -85.506715\",\n            \"Access\": \"Memorial 24/7. The park itself is only open dawn to dusk.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While you\'re here, you owe it to yourself to visit Sunken Gardens, located right next to the memorial to the east. See how beautiful an abandoned quarry/eyesore can become with the right people behind a dream. https://bit.ly/2t4bgjJ\",\n            \"imageName\": \"2019in3.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN4\",\n            \"category\": \"TOH\",\n            \"name\": \"Cenotaph Square\",\n            \"value\": 1,\n            \"address\": \"700 N Pennsylvania St.\",\n            \"city\": \"Indianapolis\",\n            \"state\": \"IN\",\n            \"GPS\": \"39.777303, -86.156790\",\n            \"Access\": \"24/7 to the Memorial, daylight hours for the Mall grounds.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While here, visiting the Museum in the American Legion Headquarters is highly advised. It has a wonderful display of military and Legion related items and is free of charge. https://bit.ly/2Rn5zfn\",\n            \"imageName\": \"2019in4.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN5\",\n            \"category\": \"TOH\",\n            \"name\": \"A Journey Begun\",\n            \"value\": 1,\n            \"address\": \"Marion, Indiana\",\n            \"city\": \"Marion\",\n            \"state\": \"IN\",\n            \"GPS\": \"40.571654, -85.662527\",\n            \"Access\": \"24/7, ADA-accessible\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Nearby in the small town of Fairmont. Is the birthplace of James Dean. In town are memorials and a Museum dedicated to him. Itâs open daily 9am-6pm and is free of charge.\",\n            \"imageName\": \"2019in5.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN6\",\n            \"category\": \"TOH\",\n            \"name\": \"Virgil I. \\\"Gus\\\" Grissom Monument\",\n            \"value\": 1,\n            \"address\": \"407 S 6th St.\",\n            \"city\": \"Mitchell\",\n            \"state\": \"IN\",\n            \"GPS\": \"38.729381, -86.471169\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Also close by in Spring Mill State Park, stands the Virgil I. Grissom Memorial Museum, where youâll find more information about this hero\'s life and items from his NASA\'s career.\",\n            \"imageName\": \"2019in6.jpg\"\n        },\n        {\n            \"bonusCode\": \"IN7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"S Bell Rd. and State St.\",\n            \"city\": \"Newburgh\",\n            \"state\": \"IN\",\n            \"GPS\": \"37.955515, -87.404716\",\n            \"Access\": \"24/7, ADA accessible\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"John Sprinkl