ny \\\"C\\\" 137th Infantry - Santa Fe Division\",\n            \"value\": 1,\n            \"address\": \"Across from 203 W Main St.\",\n            \"city\": \"Council Grove\",\n            \"state\": \"KS\",\n            \"GPS\": \"38.661827, -96.484062\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Thereâs a Madonna of the Trail at the corner of W Main St. and N Union St.\",\n            \"imageName\": \"2019ks1.jpg\"\n        },\n        {\n            \"bonusCode\": \"KS2\",\n            \"category\": \"TOH\",\n            \"name\": \"All Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"7349 US-56\",\n            \"city\": \"Kinsley\",\n            \"state\": \"KS\",\n            \"GPS\": \"37.9183, -99.42118\",\n            \"Access\": \"24/7 Caution: dirt parking lot.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Kinsley earned the name \\\"Midway USA\\\" by being exactly 1,561 miles from San Francisco to the west and 1,561 miles to New York in the east, inspiring a 1939 Saturday Evening Post cover showing two cars, starting in Kinsley and going in opposite directions, both bearing a sign saying, \\\"World\'s Fair or Bust.\\\" In 1939, there were two \\\"World\'s Fairs\\\": an eponymous one in New York, and the Golden Gate Exposition in San Francisco. The sign is in a nice park just down the street, along with a nice locomotive.\",\n            \"imageName\": \"2019ks2.jpg\"\n        },\n        {\n            \"bonu