    \"Access\": \"24/7. Caution: loose gravel present.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If your ride needs service or repair, there are multiple shops in the greater Baton Rouge area. And if youâre tired of fast food, check out some of the local culinary delights in Central such as Central Perk Coffee Shop and Cafe at 6691 Sullivan Rd., or Carltonâs Seafood at 12424 Hooper Rd. for solid Southern cooking.\",\n            \"imageName\": \"2019la1.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Park\",\n            \"value\": 1,\n            \"address\": \"1236 Main St.\",\n            \"city\": \"Elton\",\n            \"state\": \"LA\",\n            \"GPS\": \"30.481453, -92.697386\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Elton was incorporated as a village in 1911. The areaâs economic base is composed of health care services, shipbuilding, construction, manufacturing, agriculture, and oil field services.\",\n            \"imageName\": \"2019la2.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans War Memorial\",\n            \"value\": 1,\n            \"address\": \"3811 LA- 1\",\n            \"city\": \"Grand Isle\",\n            \"state\": \"LA\",\n            \"GPS\": \"29.242909, -89.977068\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Grand Isle is Louisianaâs only inhabited barrier island. As an early home to Native Americans, then plantations, and later the pirate Jean Lafitte, the island holds an important place in the history of Louisiana. But Grand Isle is much more than just history, itâs been home to locals for hundreds of years, people who have lived off the land and water raising their families and creating a unique culture. Today, the island is home to around 1,500 locals, who make a living from the seafood and oil industries. More than 12,000 tourists visit the island annually to participate in fishing rodeos and enjoy the wide-open beaches and countless bird sightings.\",\n            \"imageName\": \"2019la3.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"6th St. and S Allen Ave.\",\n            \"city\": \"Jonesboro\",\n            \"state\": \"LA\",\n            \"GPS\": \"32.239694, -92.716104\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The area is supported by the timber and service industries. For some local fare, check out either Diggidy Dawgs Southern Eatery, a veteran-owned eatery featuring âspecialty hot dogs, hamburgers, and moreâ¦â at 330 Old Winnfield Rd., or Trainaâs Bakery & Grocery for bakery items and po boys at 211 6th St.\",\n            \"imageName\": \"2019la4.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"7101 LA- 1\",\n            \"city\": \"Marksville\",\n            \"state\": \"LA\",\n            \"GPS\": \"31.104331, -92.061782\",\n            \"Access\": \"24/7. Park in the parking lot for photo.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Avoyelles Parish, in central Louisiana, takes its name from Avoyels Indians, and the locals commemorate their Native American as well as French Creole heritage. The abundant wildlife and many waterways make this a hunting, fishing and birdwatching paradise, year-round. Casino action boasts a different kind of wildlife, and a variety of accommodations make for a comfortable stay as you explore.\",\n            \"imageName\": \"2019la5.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA6\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 14\",\n            \"value\": 1,\n            \"address\": \"âOn Eternal Patrolâ\",\n            \"city\": \"Shreveport\",\n            \"state\": \"LA\",\n            \"GPS\": \"32.497188, -93.814021\",\n            \"Access\": \"24/7, two photos may be required\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Even if youâre dining at the Post, another one on the RTE-USA Challenge list is the Blind Tiger Restaurant at 120 Texas St., known for itâs blackened seafood and other Cajun specialties.\",\n            \"imageName\": \"2019la6.jpg\"\n        },\n        {\n            \"bonusCode\": \"LA7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Front St. and Davis St.\",\n            \"city\": \"Winnsboro\",\n            \"state\": \"LA\",\n            \"GPS\": \"32.148753, -91.705339\",\n            \"Access\": \"24/7, Caution: gravel present.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Winnsboro is a small city and the parish seat of Franklin Parish. A regional commerce âhubâ for surrounding communities both within and without Franklin Parish, it is the heart of âCotton Countryâ in northeast Louisiana , and a place where âcountry livingâ is more than just a metaphor. It also displays the largest US flag in the state. The parishâs quiet country roads with cattle grazing in bordering fields are peaceful avenues into rural Louisiana.\",\n            \"imageName\": \"2019la7.jpg\"\n        },\n        {\n            \"bonusCode\": \"MI1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Serenity Pines Cemetery\",\n            \"city\": \"Au Train, U.P.\",\n            \"state\": \"LA\",\n            \"GPS\": \"46.432058, -86.844380\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019mi1.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS38\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Handler JR Searcy Memorial\",\n            \"value\": 1,\n            \"address\": \"5775 Jonesboro Rd.\",\n            \"city\": \"West Monroe\",\n            \"state\": \"LA\",\n            \"GPS\": \"32.411520, -92.209060\",\n            \"Access\": \"\",\n            \"flavor\": \"JR Searcy Library\\nhttps://goo.gl/nXDzZ9\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs38.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS196\",\n            \"category\": \"Doughboys\",\n            \"name\": \"New Orleans (NEMV)\",\n            \"value\": 1,\n            \"address\": \"S Galvez and Tulane\",\n            \"city\": \"New Orleans\",\n            \"state\": \"LA\",\n            \"GPS\": \"29.95937 -90.08434\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys196.jpg\"\n        },\n        {\n            \"bonusCode\": \"GOLDSTARS8\",\n            \"category\": \"Gold Stars\",\n            \"name\": \"Veterans Memorial Park\",\n            \"value\": 1,\n            \"address\": \"State Capitol Dr\",\n            