hoto verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019mi5.jpg\"\n        },\n        {\n            \"bonusCode\": \"MI6\",\n            \"category\": \"TOH\",\n            \"name\": \"âUnited By Sacrificeâ\",\n            \"value\": 1,\n            \"address\": \"111 1st St.\",\n            \"city\": \"Coleman\",\n            \"state\": \"MI\",\n            \"GPS\": \"43.755082, -84.582905\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: Bomber\'s Bar & Grill located at 107 4th St., continues its nine year run of supporting of the Coleman Veterans Memorial. Owner Tommy Colebankâs staff works tirelessly before and during the concert to ensure patrons are happy. They have great food, the best in town. Eddie Money loved Bomber\'s Pizza!\",\n            \"imageName\": \"2019mi6.jpg\"\n        },\n        {\n            \"bonusCode\": \"MI7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"N Saginaw St. and Livingston St.\",\n            \"city\": \"Durand\",\n            \"state\": \"MI\",\n            \"GPS\": \"42.916174, -83.985031\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: Thirty-one years before Durand was a village, the first railroad, the Detroit and Milwaukee, arrived in 1856. By the turn of the century, as many as thirty-five passenger trains, one hundred freight trains, and three thousand passengers used the Durand Depot each day. The D-Railed Bar & Grill, located at 111 N. Saginaw St., serves up a taste of what folks around here have enjoyed for years.\",\n            \"imageName\": \"2019mi7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC1\",\n            \"category\": \"TOH\",\n            \"name\": \"2nd Infantry Division WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"Across from 200 17th St. SW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.892570, -77.037968\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Standing in the shadow of the Washington Monument, the nearby memorials on the National Mall as well as those in Arlington across the river, including the National Cemetery are must see stops.\",\n            \"imageName\": \"2019dc1.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Headquarters-DC\",\n            \"value\": 1,\n            \"address\": \"1608 K St. NW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.902320, -77.037269\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Monuments and memorials abound in Washington DC but visits to the Smithsonian Museums on the National Mall should not be missed. The National Zoo and the Kennedy Centerâs Millennium Stage (free concerts at 6pm) offer entertaining respite from hours of educational immersion at the museums.\",\n            \"imageName\": \"2019dc2.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC3\",\n            \"category\": \"TOH\",\n            \"name\": \"Freedom Bell\",\n            \"value\": 1,\n            \"address\": \"Union Station Columbus Monument Dr. NE\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.896565, -77.006535\",\n            \"Access\": \"24/7, two photos required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Park your bike in the garage on the corner and walk to the Capitol southwest of this spot. Of course, thereâs the Botanic Garden and the National Mall with the Smithsonian Museums across from that and then the Washington Monument further down. A visit to the National Museum of African American History and Culture is highly recommended.\",\n            \"imageName\": \"2019dc3.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC4\",\n            \"category\": \"TOH\",\n            \"name\": \"Mahatma Gandhi Peace Memorial\",\n            \"value\": 1,\n            \"address\": \"2107 Massachusetts Ave. NW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.911019, -77.046961\",\n            \"Access\": \"24/7, two photos may be required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Across the street youâll find the Society of the Cincinnati where youâll find a treasure trove of information on the Revolutionary War. https://bit.ly/1IwMbyK\",\n            \"imageName\": \"2019dc4.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE1\",\n            \"category\": \"TOH\",\n            \"name\": \"WWII Memorial\",\n            \"value\": 1,\n            \"address\": \"1 The Circle\",\n            \"city\": \"Georgetown, DE\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.690133, -75.385183\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Marvel Carriage Museum is an odd little place featuring carriages, telephones, stage coaches, victrolas and other Georgetown historical items. https://bit.ly/2MP5gEV\",\n            \"imageName\": \"2019de1.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE2\",\n            \"category\": \"TOH\",\n            \"name\": \"Korean War Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial Park\",\n            \"city\": \"New Castle, DE\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.694395, -75.550080\",\n            \"Access\": \"Dawn to dusk, two photos required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Other memorials in the plaza include the WWII Submariners Memorial, Desert Shield/Desert Storm Memorial, Vietnam Memorial and Wounded Combat Veterans Memorial.\",\n            \"imageName\": \"2019de2.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE3\",\n            \"category\": \"TOH\",\n            \"name\": \"Life Saving Memorial and Museum\",\n            \"value\": 1,\n            \"address\": \"25039 Coastal Hwy.\",\n            \"city\": \"Rehoboth Beach, DE\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.634102, -75.067013\",\n            \"Access\": \"24/7, Caution: gravel in parking area\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Check out the WWII Observation Tower in Dewey Beach only a few miles up the Coastal Highway.\",\n            \"imageName\": \"2019de3.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 14\",\n            \"value\": 1,\n            \"address\": \"107 W Glenwood Ave.\",\n            \"city\": \"Smyrna, DE\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.301915, -75.611831\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Located in a former 1940s movie theater, the Painted Stave Distillery creates small batch spirits from locally sourced ingredients and offers tours. https://bit.ly/2WxY5oM\",\n            \"imageName\": \"2019de4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"N Rogers St. and N Parke St.\",\n            \"city\": \"Aberdeen, MD\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.513168, -76.163650\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"A great lunch platter can be had at Grumpyâs Bar & Grille located in the Aberdeen Travelodge Hotel. Try the open-faced hot sandwiches. https://bit.ly/2SfJUpc\",\n            \"imageName\": \"2019md1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 96\",\n            \"value\": 1,\n            \"address\": \"18 S Maple Ave.\",\n            \"city\": \"Brunswick, MD\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.312333, -77.627074\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Harpers Ferry National Historic Park (https://bit.ly/2MHWwQG) is just over the state line as is the Appalachian Trail Conservancy HQ & Visitors Center (https://bit.ly/2RWO0TT) â both worth a stop while youâre in the area. Note that Harpers Ferry NPS is part of the National Parks Tour https://bit.ly/2FZysIx.\",\n            \"imageName\": \"2019md2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD3\",\n            \"category\": \"TOH\",\n            \"name\": \"Gulf War Memorial\",\n            \"value\": 1,\n            \"address\": \"Gulf Memorial Dr. and E Union St.\",\n            \"city\": \"Cumberland, MD\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.651247, -78.758013\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The C&O Canal National Historic Park is an education in the history and technology of this famous canal â thereâs a model of the famous Paw Paw Tunnel (or you can go see & walk the real one â with its 6 million bricks and nearly Â¾ miles of tunnel trailway). https://bit.ly/2HJsIV4\",\n            \"imageName\": \"2019md3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD4\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Monument\",\n            \"value\": 1,\n            \"address\": \"Across from 22696 Washington St.\",\n            \"city\": \"Leonardtown, MD\",\n            \"state\": \"MI\",\n            \"GPS\": \"38.290850, -76.635917\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While youâre in Leonardtown you should stop by the historical society (Moll Dyer Road) and see Moll Dyerâs Rock. Yep, itâs a rock. But itâs the story you go for â legend has it that Moll Dyer was a witch who was chased from her home on a cold winter night in 1697 and found frozen to the rock, her handprints permanently embedded. Stories say her spirit haunts the land, looking for the men who forced her from her home.\",\n            \"imageName\": \"2019md4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ1\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"413 2nd St.\",\n            \"city\": \"Belvidere, NJ\",\n            \"state\": \"MI\",\n            \"GPS\": \"40.827346, -75.077108\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Itâs not a stainless-steel classic, but Uncle Buckâs Diner (2 Market St) is an original, complete with spinning stools at the counter.\",\n            \"imageName\": \"2019nj1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 351\",\n            \"value\": 1,\n            \"address\": \"1400 Bay Blvd.\",\n            \"city\": \"Seaside Heights, NJ\",\n            \"state\": \"MI\",\n            \"GPS\": \"39.947525, -74.078150\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Time on your hands, nowhere to go, no schedule to keep? Scoot over to the Seaside Heights Boardwalk (https://bit.ly/2RuPgbx) and Van Holtenâs Chocolates, a 100+ year old candy shop. https://bit.ly/2t0ryue\",\n            \"imageName\": \"2019nj2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ3\",\n            \"category\": \"TOH\",\n            \"name\": \"Centennial Memorial\",