value\": 1,\n            \"address\": \"17377 Stars and Stripes Way\",\n            \"city\": \"Bloomfield\",\n            \"state\": \"MO\",\n            \"GPS\": \"36.866068, -89.930865\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"30 minutes to the east, youâll find the original Lambertâs Cafe, âHome of Throwed Rolls.â www.throwedrolls.com\",\n            \"imageName\": \"2019mo1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO2\",\n            \"category\": \"TOH\",\n            \"name\": \"World War I Memorial\",\n            \"value\": 1,\n            \"address\": \"301 East High St.\",\n            \"city\": \"Jefferson City\",\n            \"state\": \"MO\",\n            \"GPS\": \"38.575149, -92.169593\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Close by is the Missouri State Capitol Building on a bluff overlooking the Missouri River. There you can find an impressive Veterans Walk with many Memorials.\",\n            \"imageName\": \"2019mo2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO3\",\n            \"category\": \"TOH\",\n            \"name\": \"All Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"N 2nd Ave. and E Church\",\n            \"city\": \"Ozark\",\n            \"state\": \"MO\",\n            \"GPS\": \"37.020728, -93.204714\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"In case you missed the original Lambertâs near the Memorial in Bloomfield you can try the one in Ozark. Or why not both? You deserve some Throwed Rolls in your life. www.throwedrolls.com\",\n            \"imageName\": \"2019mo3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO4\",\n            \"category\": \"TOH\",\n            \"name\": \"Defenders of Freedom Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Pkwy. and Locust St.\",\n            \"city\": \"Pleasant Hill\",\n            \"state\": \"MO\",\n            \"GPS\": \"38.785189, -94.273140\",\n            \"Access\": \"Data not availalbe\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Did someone say pie? If so, be sure and check out Big Creek CafÃ© at 113 Wyoming St. where pie and comfort food await. Too much pie? Bring your bicycle along and jump on the Rock Island Bike Trail that connects to the Katy Trail which will take you across the state to St. Charles, over 200 miles.\",\n            \"imageName\": \"2019mo4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO5\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Vietnam War Memorial Post 639\",\n            \"value\": 1,\n            \"address\": \"2630 S. Scenic\",\n            \"city\": \"Springfield\",\n            \"state\": \"MO\",\n            \"GPS\": \"37.166468, -93.330497\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Next door to the Post, is the Nathanael Greene Park that includes a special Blue Star Memorial Garden. Greene was known as George Washingtonâs most gifted and dependable officers.\",\n            \"imageName\": \"2019mo5.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO6\",\n            \"category\": \"TOH\",\n            \"name\": \"All Wars Memorial\",\n            \"value\": 1,\n            \"address\": \"Moberly Park\",\n            \"city\": \"Trenton\",\n            \"state\": \"MO\",\n            \"GPS\": \"40.083764, -93.623630\",\n            \"Access\": \"Dawn to dusk\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Trenton for many years was the Vienna Sausage Capital of the World, with the largest factory in the world. May 31st, 2018 was a sad day for the town when the Vienna Sausage Plant closed. So for your food recommendation, hold a Vienna Sausage high for the Grundy County folks.\",\n            \"imageName\": \"2019mo6.jpg\"\n        },\n        {\n            \"bonusCode\": \"MO7\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post #501 Memorial\",\n            \"value\": 1,\n            \"address\": \"Library Dr. and Missouri 45\",\n            \"city\": \"Weston\",\n            \"state\": \"MO\",\n            \"GPS\": \"39.421606, -94.895762\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Weston is the largest producer of twist tobacco. About 2.8 million pounds of tobacco are grown in Platte County annually. Also, McCormick Distillery has been located in Weston since 1856, making it the oldest whiskey distillery west of the Mississippi.\",\n            \"imageName\": \"2019mo7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS48\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Moberly War Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"Holman Rd. nr. W Reed St.\",\n            \"city\": \"Moberly\",\n            \"state\": \"MO\",\n            \"GPS\": \"39.420687, -92.457508\",\n            \"Access\": \"\",\n            \"flavor\": \"Rothwell Park\\nhttps://goo.gl/Btigyj\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs48.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS49\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Sedalia War Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"Nr. E 5th and S Ohio Aves.\",\n            \"city\": \"Sedalia\",\n            \"state\": \"MO\",\n            \"GPS\": \"38.707008, -93.227995\",\n            \"Access\": \"\",\n            \"flavor\": \"Pettis Co. Courthouse\\nhttps://goo.gl/obwXHF\",\n            \"ma