\n            \"state\": \"MS\",\n            \"GPS\": \"32.343996,-90.851346\",\n            \"Access\": \"\",\n            \"flavor\": \"NMP\\nhttps://www.nps.gov/vick/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks149.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion C James Smith Post 6\",\n            \"value\": 1,\n            \"address\": \"33 1st St NW\",\n            \"city\": \"Choteau\",\n            \"state\": \"MT\",\n            \"GPS\": \"47.812003, -112.185006\",\n            \"Access\": \"24/7. Inside access 12 noon to 2am, 7 days a week.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019mt1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Bruegger Centennial Park\",\n            \"city\": \"Culbertson\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.145759, -104.513522\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Culbertson, located in North Eastern Montana borders the Bakken oil field. Tertiary development (fracking) of this large oil pool resulted in a huge population explosion in NE Montana and NW North Dakota in the 2010s and remains the significant economic driver in this area today.\",\n            \"imageName\": \"2019mt2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"1222 US-2\",\n            \"city\": \"Glasgow\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.207975, -106.640968\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Glasgow is located just north of the Fort Peck Reservoir, a large manmade lake created by the worldâs largest (at the time) earth filled dam on the Missouri River. This dam and reservoir was created as part of the 1930s New Deal program reshaping the region and continues to provide electrical power and flood control.\",\n            \"imageName\": \"2019mt3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"1st St. and 3rd Ave.\",\n            \"city\": \"Havre\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.553466, -109.678070\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Havre is 40 miles south of the Canadian border and is known as being on the âHi-Line,â Burlington-Northernâs term for the 200-mile northernmost stretch of track in the U.S. Besides the railroad, beef and wheat are the main economy, now being replaced by wineries and breweries.\",\n            \"imageName\": \"2019mt4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT5\",\n            \"category\": \"TOH\",\n            \"name\": \"Vietnam and Desert Storm Memorial\",\n            \"value\": 1,\n            \"address\": \"35 S 1st St. E\",\n            \"city\": \"Malta\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.359952, -107.872812\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Malta is home to the Great Plains Dinosaur Museum which contains several examples of dinosaurs that were all unearthed locally.\",\n            \"imageName\": \"2019mt5.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial Flag\",\n            \"value\": 1,\n            \"address\": \"455 McKinley Ave.\",\n            \"city\": \"Shelby\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.509681, -111.878705\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Shelby is located just south of the Sweet Grass Hills, some of which are visible in the picture above. The Hills are near the Canada border and are important area landmarks sacred to the people of Blackfeet tribe who reside on both sides of the border.\",\n            \"imageName\": \"2019mt6.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Roosevelt Park\",\n            \"city\": \"Troy\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.470508, -115.889442\",\n            \"Access\": \"24/7, if gate isnât open, two photos may be required.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Troy has the distinction of having the lowest elevation of any town in Montana. Located on the Kootenai River just before it exits Montana and enters Idaho, this area is a beautiful example of Northwest Rain forest and home to a diverse population of wildlife.\",\n            \"imageName\": \"2019mt7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS51\",\n            \"category\": \"War Dogs\",\n            \"name\": \"War Dogs Memorial\",\n            \"value\": 1,\n            \"address\": \"18th & Main Sts.\",\n            \"city\": \"Ft. Benton\",\n            \"state\": \"MT\",\n            \"GPS\": \"47.820849, -110.664817\",\n            \"Access\": \"\",\n            \"flavor\": \"Veterans Park\\nhttps://goo.gl/GdLw4x\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs51.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS71\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Columbia Falls MT EMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"400 Veteran Drive\",\n            \"city\": \"Columbia Falls\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.358431,-114.21079\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys71.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS72\",\