    \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks96.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion John F. Hiskey Post 45\",\n            \"value\": 1,\n            \"address\": \"90 South St.\",\n            \"city\": \"Austin\",\n            \"state\": \"NV\",\n            \"GPS\": \"39.492533, -117.071719\",\n            \"Access\": \"24/7, little to no external lighting. Caution: parking is on sloped, hard packed gravel. Take âer slow.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019nv1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV2\",\n            \"category\": \"TOH\",\n            \"name\": \"Killed In Action Memorial\",\n            \"value\": 1,\n            \"address\": \"4th Ave. and Lincoln Hwy.\",\n            \"city\": \"Dayton\",\n            \"state\": \"NV\",\n            \"GPS\": \"39.239816, -119.589321\",\n            \"Access\": \"24/7, Caution: soft dirt/sand present.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Several areas of interest are located within a short distance of Dayton, including the historic old west town of Virginia City to the north, and Carson City and Lake Tahoe to the west.\",\n            \"imageName\": \"2019nv2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV3\",\n            \"category\": \"TOH\",\n            \"name\": \"NHP Officer Carlos J Borland Memorial\",\n            \"value\": 1,\n            \"address\": \"Fallon Rest Stop\",\n            \"city\": \"Fallon\",\n            \"state\": \"NV\",\n            \"GPS\": \"39.9406667, -118.7501667\",\n            \"Access\": \"24/7, suggest recon before arriving\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019nv3.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 8\",\n            \"value\": 1,\n            \"address\": \"733 N Veterans Memorial Dr,\",\n            \"city\": \"Las Vegas\",\n            \"state\": \"NV\",\n            \"GPS\": \"36.177728, -115.138425\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"\\\"Sin City\\\" has so much to offer, where to start? You can visit the Neon Museum for one thing, just a couple of blocks from here. neonmuseum.org\",\n            \"imageName\": \"2019nv4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV5\",\n            \"category\": \"TOH\",\n            \"name\": \"NV5 â Orovada\",\n            \"value\": 1,\n            \"address\": \"CCC Firefighter Memorial\",\n            \"city\": \"Orovada\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.5427333, -117.7868667\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Winnemucca is 45 miles south of here, but youâll probably be passing through it at some point. Dining choices include: The Pig BBQ at 1139 W Winnemucca Blvd., The Griddle at 460 W Winnemucca Blvd., or Toasted Tavern (RTE-USA site) at 485 W Winnemucca Blvd.\",\n            \"imageName\": \"2019nv5.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial Park Walk\",\n            \"value\": 1,\n            \"address\": \"Chief Tecopa Cemetery\",\n            \"city\": \"Pahrump\",\n            \"state\": \"NV\",\n            \"GPS\": \"36.209105, -115.991120\",\n            \"Access\": \"Daylight hours only\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Pahrump Valley was originally settled by the Pauite Indians, and in the late 19th century settled by prospective gold and silver miners. In the early 20th century, cotton and alfalfa was cultivated here. Now itâs a retirement haven with the 2010 census showing over 10,000 veterans call Pahrump home, more than a quarter of the population.\",\n            \"imageName\": \"2019nv6.jpg\"\n        },\n        {\n            \"bonusCode\": \"NV7\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"VFW Post 1103\",\n            \"city\": \"Tonopah\",\n            \"state\": \"NV\",\n            \"GPS\": \"38.066589, -117.229355\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Tonopah has a rich history in both mining and the military. It was the site of the second largest silver strike in Nevada\'s history, just behind the famous Comstock Load to the north. Founded in 1900 by a prospector by the name of Jim Butler, silver ore production in that first year was over $750,000.\",\n            \"imageName\": \"2019nv7.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT1\",\n            \"category\": \"TOH\",\n            \"name\": \"Josh Piver Memorial\",\n            \"value\": 1,\n            \"address\": \"Stonington Point\",\n            \"city\": \"Stonington, CT\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.327883, -71.905183\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are vineyards near here, and for lighthouse collectors, thereâs the Old Lighthouse Museum for a tour and a chance to bag another lighthouse. Thereâs also the Captain Nathaniel Brown Palmer House (and lighthouse) so two in one town. https://bit.ly/2MIULCV\",\n            \"imageName\": \"2019ct1.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT2\",\n            \"category\": \"TOH\",\n            \"name\": \"Navy Chaplain Memorial\",\n            \"value\": 1,\n            \"address\": \"74 W Main St.\",\n            \"city\": \"Waterbury, CT\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.556951, -73.042181\",\n            \"Access\": \"24/7, daylight hours suggested\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The book, âIn Harmâs Wayâ by Doug Stanton tells the story of the USS Indianapolis and is a great read while youâre on the Tour. Besides taking a tour of the Basilica, a ride over to the corner of the Chase Parkway takes you to the Pilgrim Memorial, an intricately carved 60 foot long French granite memorial to the Pilgrims who helped found the city.\",\n            \"imageName\": \"2019ct2.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT3\",\n            \"category\": \"TOH\",\n            \"name\": \"Lone Sailor Memorial\",\n            \"value\": 1,\n            \"address\": \"4 Palace St.\",\n            \"city\": \"West Haven, CT\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.257897, -72.948671\",\n            \"Access\": \"24/7, daylight hours suggested\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just to the west, Jimmies of Savin Rock is a full service restaurant where if youâre lucky, theyâll make you an original split hot-dog, their own invention nearly 100 years ago when it was simply a roadside hot-dog stand. https://bit.ly/2ShNter\",\n            \"imageName\": \"2019ct3.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 86\",\n            \"value\": 1,\n            \"address\": \"Wilton, Connecticut\",\n            \"city\": \"Wilton, CT\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.193514, -73.431339\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Weir Farm National Historic Site is the only national park for an artist and worth a tour. https://bit.ly/2uaRtBg\",\n            \"imageName\": \"2019ct4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA1\",\n            \"category\": \"TOH\",\n            \"name\": \"Massachusetts Fallen Firefighters Memorial\",\n            \"value\": 1,\n            \"address\": \"24 Beacon St.\",\n            \"city\": \"Boston, MA\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.358760, -71.063182\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are hundreds of sights, museums, restaurants and shopping opportunities in Boston. Walk the Freedom Trail following the steps painted on the sidewalks, or take the Boston Pizza Tour (https://bit.ly/2mjWXUp) through the famous Italian North End. Fenway Park or the USS Constitution are close by as is Faneuil Hall and Quincy Market. Take an amphibious Duck Boat tour (https://bit.ly/2SX7Zhc) of the streets and harbor. Whatever you do, donât just ride in & ride out. Take advantage of all the city has to offer https://bit.ly/2jmjodu\",\n            \"imageName\": \"2019ma1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Operation Iraqi Freedom Memorial\",\n            \"value\": 1,\n            \"address\": \"Franklin Town Common\",\n            \"city\": \"Franklin, MA\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.089333, -71.401700\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre staying over, the British Beer Company is the place for a variety of beer on tap (and bottles) and good pub food. https://bit.ly/2HEeK6K\",\n            \"imageName\": \"2019ma2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Revolutionary War Memorial\",\n            \"value\": 1,\n            \"address\": \"Main St. and Walker St.\",\n            \"city\": \"Lenox, MA\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.356850, -73.285067\",\n            \"Access\": \"24/7, donât try to park at the island, may require two photos\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Nearby Tanglewood is the summer home of the Boston Symphony Orchestra and several other prominent musicians (James Taylor, Yo-Yo Ma, Kristine Opolais and John Williams) playing under the stars. https://www.bso.org\",\n            \"imageName\": \"2019ma3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 138\",\n            \"value\": 1,\n            \"address\": \"175 Main St.\",\n            \"city\": \"Spencer, MA\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.245109, -71.991337\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Kostas CafÃ© (31 Pleasant St.), Five Loaves Bakery (https://bit.ly/2GcmWZH) and Spencer Pizza House (https://bit.ly/2t0xxPG) are all great bets for a good meal at a reasonable price.\",\n            \"imageName\": \"2019ma4.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME1\",\n            \"category\": \"TOH\",\n            \"name\": \"Law Enforcement Memorial\",\n            \"value\": 1,\n            \"address\": \"230 State St.\",\n            \"city\": \"Augusta, ME\",\n            \"state\": \"NV\",\n            \"GPS\": \"44.305647, -69.781444\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are other memorials in the State Capitol grounds â Firefighters and EMS first responders are also honored in memorials a little south of this one.\",\n            \"imageName\": \"2019me1.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME2\",\n            \"category\": \"TOH\",\n            \"name\": \"Maine Vietnam War Memorial\",\n            \"value\": 1,\n            \"address\": \"405 Perry Rd.\",\n            \"city\": \"Bangor, ME\",\n            \"state\": \"NV\",\n            \"GPS\": \"44.785508, -68.804164\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Cole Land Transportation Museum contains displays of land transportation vehicles and exhibits including the worldâs largest indoor display of snow plows as well as fire engines, farm vehicles, snowmobiles, trucks, cars and even a recreated train station. The museum is only steps away from the memorial and open from 9-5 daily. Highly recommended for gearheads.\",\n            \"imageName\": \"2019me2.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME3\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 94\",\n            \"value\": 1,\n            \"address\": \"218 Pritham Ave.\",\n            \"city\": \"Greenville, ME\",\n            \"state\": \"NV\",\n            \"GPS\": \"45.459155, -69.602318\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For a peek into the life of a lumber town, this town in the heart of Maineâs forests, offers the Moosehead Historical Society Museum. Check out the exhibits in the Aviation museum as well for insights into the adventures of bush pilots in this remote part of the country. https://bit.ly/2RtdL99\",\n            \"imageName\": \"2019me3.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME4\",\n            \"category\": \"TOH\",\n            \"name\": \"Double Eagle II Monument\",\n            \"value\": 1,\n            \"address\": \"140 Spragueville Rd.\",\n            \"city\": \"Presque Isle, ME\",\n            \"state\": \"NV\",\n            \"GPS\": \"46.626820, -68.021254\",\n            \"Access\": \"24/7. Caution: gravel turnout\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If you came up Rt 1 (about the only way), you may have noticed the odd planet model perched atop a pole roadside. Hop over to U of Maine and see the Sun. This is the only scale model of the solar system in the United States (maybe the world). On the way back, keep an eye out until you get to Pluto at the visitorâs center in Houlton.\",\n            \"imageName\": \"2019me4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH1\",\n            \"category\": \"TOH\",\n            \"name\": \"Fallen Firefighters Memorial\",\n            \"value\": 1,\n            \"address\": \"98 Smokey Bear Blvd.\",\n            \"city\": \"Concord, NH\",\n            \"state\": \"NV\",\n            \"GPS\": \"43.208696, -71.478270\",\n            \"Access\": \"24/7, donât park in the FD driveway for obvious reasons\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Of course, the State House and the nearby NH Historical Society are steeped in history, but a quick trip to the McAuliffe-Shepard Discovery Center will take you to the stars with New Hampshireâs own astronauts Alan Shepard and Christa McAuliffe. https://bit.ly/2WydG7R\",\n            \"imageName\": \"2019nh1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH2\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"10 Front St.\",\n            \"city\": \"Exeter, NH\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.980968, -70.946290\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Stop by for a tour at the American Independence Museum for displays and artifacts from before there was a United States. Watch for one of the many historical re-enactments held here each summer. https://bit.ly/2sYXsY3\",\n            \"imageName\": \"2019nh2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH3\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 17\",\n            \"value\": 1,\n            \"address\": \"206 State St.\",\n            \"city\": \"Groveton, NH\",\n            \"state\": \"NV\",\n            \"GPS\": \"44.606652, -71.525517\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The North Country Restaurant (12 Main St) is the place in town for breakfast â omelettes, pancakes, French toast (try the raisin bread version!) hit the spot. This is a townie favorite so you know youâre in good hands.\",\n            \"imageName\": \"2019nh3.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH4\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"Schouler Park\",\n            \"city\": \"North Conway, NH\",\n            \"state\": \"NV\",\n            \"GPS\": \"44.052417, -71.127972\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Take a few hours and ride the Kancamagus Highway (Rt 112 from Center Conway to North Woodstock) and then turn around and ride it again. Itâs one of the best riding roads in New England. LL Bean has a factory store on Rt 16 or you can head across the state line to Maine and to the factory itself.\",\n            \"imageName\": \"2019nh4.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"374 N Rd.\",\n            \"city\": \"Hope, RI\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.736591, -71.563786\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Billâs Place is only a couple of miles away in West Warwick is a local favorite for Greek specialties, grinders and pizza. https://bit.ly/2HEm8iu\",\n            \"imageName\": \"2019ri1.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Deerfield Park\",\n            \"city\": \"Smithfield, RI\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.882084, -71.551392\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Jaswellâs Farm is the place to stop for fresh apple cider, pie and warm cider donuts. https://bit.ly/2G5Wl1l\",\n            \"imageName\": \"2019ri2.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Broad St. and Grove Ave.\",\n            \"city\": \"Westerly, RI\",\n            \"state\": \"NV\",\n            \"GPS\": \"41.377317, -71.827733\",\n            \"Access\": \"24/7, two photos required for parking reasons\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"A stop at the Malted Barley will get you only two things â beer of all kinds, and pretzels; some of the best in the region. https://bit.ly/2SdQqwI\",\n            \"imageName\": \"2019ri3.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Fairmount Post 85\",\n            \"value\": 1,\n            \"address\": \"870 River St.\",\n            \"city\": \"Woonsocket, RI\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.007001, -71.527636\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Museum of Work and Culture is a local museum focused on the history of French-Canadians and workers in the RI & New England area. https://bit.ly/1E1tAby\",\n            \"imageName\": \"2019ri4.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Church St. and Village Sq.\",\n            \"city\": \"Barton, VT\",\n            \"state\": \"NV\",\n            \"GPS\": \"44.750761, -72.179985\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"This far north, youâll need to tread a little out of town for sights and eats, unless youâre here before Parsonâs Corner (14 Glover Rd) closes and then youâll want to stop there for breakfast or lunch. Great local place.\",\n            \"imageName\": \"2019vt1.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 13\",\n            \"value\": 1,\n            \"address\": \"255 Northside Dr.\",\n            \"city\": \"Bennington, VT\",\n            \"state\": \"NV\",\n            \"GPS\": \"42.901094, -73.211675\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Bennington Battle Monument (on Monument Circle naturally) is modeled after the Washington Monument and dominates the view of Bennington. The Bennington Museum (75 Main St) has the worldâs largest collection of Grandma Moses paintings as well as extensive exhibits on Vermont and its history.\",\n            \"imageName\": \"2019vt2.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT3\",\n            \"category\": \"TOH\",\n            \"name\": \"Korea War Memorial\",\n            \"value\": 1,\n            \"address\": \"Main St. south of Center St.\",\n            \"city\": \"Rutland, VT\",\n            \"state\": \"NV\",\n            \"GPS\": \"43.606878, -72.971995\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Vermont State Fair and Norman Rockwell Museum (https://bit.ly/2HHoKfK) are places to visit for fun, but skip the Dennyâs and the McDonaldâs chain places and sit down at Johnny Boyâs Pancake House for an omelet or maple pancakes where the syrup was tapped by neighbors nearby. https://bit.ly/2Se2w99\",\n            \"imageName\": \"2019vt3.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT4\",\n            \"category\": \"TOH\",\n            \"name\": \"Honor Roll\",\n            \"value\": 1,\n            \"address\": \"Gage St. and Saxtons River Rd.\",\n            \"city\": \"Westminster, VT\",\n            \"state\": \"NV\",\n            \"GPS\": \"43.118659, -72.455066\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.touro