     },\n        {\n            \"bonusCode\": \"PARKS156\",\n            \"category\": \"Parks\",\n            \"name\": \"Womenâs Rights NHP\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Senaca Falls\",\n            \"state\": \"NY\",\n            \"GPS\": \"42.910670,-76.800184\",\n            \"Access\": \"\",\n            \"flavor\": \"NHP\\nhttps://www.nps.gov/wori/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks156.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH1\",\n            \"category\": \"TOH\",\n            \"name\": \"9/11 Memorial\",\n            \"value\": 1,\n            \"address\": \"Williams Park\",\n            \"city\": \"Gibsonburg\",\n            \"state\": \"OH\",\n            \"GPS\": \"41.386721, -83.318975\",\n            \"Access\": \"Dawn to dusk. This is a quiet small town and the memorial is located on a residential street. Be respectful when visiting and be aware of children playing in the street.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019oh1.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH2\",\n            \"category\": \"TOH\",\n            \"name\": \"Vietnam Memorial\",\n            \"value\": 1,\n            \"address\": \"Monument St. and E Jefferson St.\",\n            \"city\": \"New Lexington\",\n            \"state\": \"OH\",\n            \"GPS\": \"39.719481, -82.210626\",\n            \"Access\": \"24/7, parking in the abandoned gas station lot just south of the memorial.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019oh2.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"407 Main St.\",\n            \"city\": \"New Straitsville\",\n            \"state\": \"OH\",\n            \"GPS\": \"39.577699, -82.237052\",\n            \"Access\": \"24/7, parking in the library parking lot with handicap access.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The historic Robinson`s Cave is just a few blocks down the street (39.577883, -82.238833) where groups of Hocking Valley coal miners could meet in secret beginning in the 1870s. Christopher Evans, a well-known union organizer, used the cave to lead miners throughout the long Hocking Valley Coal Strike of 1884-1885. Robinson\'s Cave is referred to as the secret birthplace of the United Mine Workers.\",\n            \"imageName\": \"2019oh3.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"South Point, Ohio\",\n            \"city\": \"South Point\",\n            \"state\": \"OH\",\n            \"GPS\": \"38.418596, -82.590017\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Itâs a 30 minute ride northeast to Hillbilly Hot Dog, located at 6951 Ohio River Rd, Lesage, West Virginia. They were made Famous by Diners, Drive Ins, and Dives and deservedly so. Itâs a great lunch stop where you can eat in a bus, get married in a chapel, and get the Weenie song sung to you for a $1 tip. Bring your own souvenir (poker chip?) to leave hanging on the grounds, and be ready to spend some time here viewing all they have to offer. http://www.hillbillyhotdogs.com/ Part of the RTE-USA Challenge!\",\n            \"imageName\": \"2019oh4.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Gardens\",\n            \"value\": 1,\n            \"address\": \"661 Beckman Ave.\",\n            \"city\": \"St. Henry\",\n            \"state\": \"OH\",\n            \"GPS\": \"40.413195, -84.630729\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Bicycle Museum of America is a short 20 minute ride to New Bremen. They have over 300 bicycles on display and a guided tour, or explore the museum on your own. See the website for hours and information www.bicyclemuseum.com\",\n            \"imageName\": \"2019oh5.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH6\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 178\",\n            \"value\": 1,\n            \"address\": \"631 W. Main St.\",\n            \"city\": \"Van Wert\",\n            \"state\": \"OH\",\n            \"GPS\": \"40.871503, -84.591306\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019oh6.jpg\"\n        },\n        {\n            \"bonusCode\": \"OH7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Wooster Cemetary\",\n            \"city\": \"Wooster\",\n            \"state\": \"OH\",\n            \"GPS\": \"40.785214, -81.933320\",\n            \"Access\": \"Sunrise to sunset.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Lehmanâs Hardware located at 4779 Kidron Rd. in nearby Dalton, is family owned and operated since 1955, and truly unbelievable. The buildings consist of four pre-Civil War era buildings under one soaring roof, a place to embrace the past and the present: You can shop and reminisce your way through thousands of products while browsing Jayâs antique collection located throughout the store. Make sure you give yourself plenty of time as there is a LOT to see. www.l