: \"OK\",\n            \"GPS\": \"35.952763, -96.773148\",\n            \"Access\": \"\",\n            \"flavor\": \"CUH Airport - Static Display\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys252.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS253\",\n            \"category\": \"Hueys\",\n            \"name\": \"0-223?? UH-1 - Lexington\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Lexington*\",\n            \"state\": \"OK\",\n            \"GPS\": \"35.022759, -97.229958\",\n            \"Access\": \"\",\n            \"flavor\": \"Airport Static Display - Access Restricted - Photos no longer allowed\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys253.jpg\"\n        },\n        {\n            \"bonusCode\": \"PARKS152\",\n            \"category\": \"Parks\",\n            \"name\": \"Washita Battlefield NHS\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Cheyenne\",\n            \"state\": \"OK\",\n            \"GPS\": \"35.616567,-99.686394\",\n            \"Access\": \"\",\n            \"flavor\": \"NHS\\nhttps://www.nps.gov/waba/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks152.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Mt. Hope Cemetery\",\n            \"city\": \"Baker City\",\n            \"state\": \"OR\",\n            \"GPS\": \"44.763810, -117.820438\",\n            \"Access\": \"Dawn to dusk. Memorial can be viewed from S. Bridge St. â all roads are paved.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Baker City started in 1862 for gold mining in the nearby area. It remained a small western town, now with farming and cattle ranching sustaining it. Many great motorcycle roads cross the area and give you the chance to enjoy the mountains and some great twisties or Hwy. 84 for quick access to your next TOH site.\",\n            \"imageName\": \"2019or1.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"898 Elk Dr.\",\n            \"city\": \"Brookings\",\n            \"state\": \"OR\",\n            \"GPS\": \"42.055147, -124.287815\",\n            \"Access\": \"24/7, unrestricted. Donât park in Fire Dept. driveways for obvious reasons.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Brookings is a beautiful coastal town and highly sought out by retirees, as it is only six miles from the California state line. Lily bulbs are grown in the 12 miles between Brookings and Smith River, California and represent 100% of the crop for all of North America, bringing economic stability to the region. Fishing, both sport and pleasure, produce some great catches that many restaurants in the area highlight regularly. You are currently traveling on Highway 101 which traverses from Canada to Mexico so enjoy the ride. Be sure to check California for what could be the closest TOH site.\",\n            \"imageName\": \"2019or2.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial Park\",\n            \"value\": 1,\n            \"address\": \"307 SW 2nd Ave.\",\n            \"city\": \"Estacada\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.288858, -122.337343\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Estacada takes you from the busy rush of big cities back to the quiet delights of small town America. Stop to enjoy the river or the birds along the way while visiting Bagby Hot Springs just one hour up the road. Individual tubs, including whiskey barrels, allow you that full relaxation from your long and hot (or maybe wet) ride to get here. Clothing optional. Find out more at https://soakoregon.com/bagby-hot-springs/\",\n            \"imageName\": \"2019or3.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post #21\",\n            \"value\": 1,\n            \"address\": \"126 NE Atlantic St. McMinnville, Oregon\",\n            \"city\": \"McMinnville\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.201851, -123.176580\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The world-renowned Evergreen Aviation and Space Museum is just seven minutes east of here. The Spruce Goose, a SR-71 Blackbird, and the largest collection of Vietnam-era military aircraft is on display. A $12 admission ticket ($27 value) *may* be available here: https://bit.ly/2LVTXKk. If not available for some reason, ask for AAA and veterans discounts at the door.\",\n            \"imageName\": \"2019or4.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR5\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Park\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial\",\n            \"city\": \"Redmond\",\n            \"state\": \"OR\",\n            \"GPS\": \"44.26863, -121.19097\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Redmond was incorporated in 1910 and grew because it was along the great east to west rail line. In 1943, it was a training base for B17 and B38 pilots. This a great area to ride with an average 325 days of sunshine each year and lots of recreation activities.\",\n            \"imageName\": \"2019or5.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR6\",\n            \"category\": \"TOH\",\n            \"name\": \"Korea War Memorial\",\n            \"value\": 1,\n            \"address\": \"Dept. of Veteran Affairs Bldg.\",\n            \"city\": \"Salem\",\n            \"state\": \"OR\",\n            \"GPS\": \"44.945181, -123.026753\",\n            \"Access\": \"24/7, unrestricted â requires two pictures as memorial is in trees to the right of water fountain.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Salem, the state capital of Oregon has a beautiful memorial park with a number of different era monuments. Located in the lush Willamette Valley that offers many vineyards hosting wineries and tasting rooms. Salem is a short distance from the Pacific Ocean or the mountains for any of your recreational needs.\",\n            \"imageName\": \"2019or6.jpg\"\n        },\n        {\n            \"bonusCode\": \"OR7\",\n            \"category\": \"TOH\",\n            \"name\": \"World War I Roll of Honor\",\n            \"value\": 1,\n            \"address\": \"251 B St. W\",\n            \"city\": \"Vale\",\n            \"state\": \"OR\",\n            \"GPS\": \"43.981011, -117.241970\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Vale was the first stop in Oregon for travelers on the Oregon Trail, and is now known for its excellent camping, hunting and fishing opportunities,. No matter which road you took to get here, you get to continue on great motorcycle roads leaving. If you came in on 26, turn north on 20 and enjoy the canyons and byways, or continue on 26 into Idaho, only 12 miles away.\",\n            \"imageName\": \"2019or7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS79\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Police K9 Memorial\",\n            \"value\": 1,\n            \"address\": \"4735 E. Burnside St.\",\n            \"city\": \"Portland\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.523097, -122.614037\",\n            \"Access\": \"\",\n            \"flavor\": \"Public Safety Building\\nhttps://goo.gl/EKyRjM\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs79.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS80\",\n            \"category\": \"War Dogs\",\n            \"name\": \"\'Hondo\' Hydrant Tribute\",\n            \"value\": 1,\n            \"address\": \"4499 NW 229th Ave.\",\n            \"city\": \"Hillsboro\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.552477, -122.909705\",\n            \"Access\": \"\",\n            \"flavor\": \"Dog Park\\nhttps://goo.gl/NatHqY\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs80.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS126\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Brookings Police Department K9\",\n            \"value\": 1,\n            \"address\": \"Elk Dr & 5th St\",\n            \"city\": \"Brookings\",\n            \"state\": \"OR\",\n            \"GPS\": \"42.055189, -124.287858\",\n            \"Access\": \"\",\n            \"flavor\": \"simple memorial at base of flag pole in front of Fire & Police Dept\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs126.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS127\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Clackamas County Law Enforcement Memorial Plaza K9\",\n            \"value\": 1,\n            \"address\": \"9101 SE Sunnybrook Blvd\",\n            \"city\": \"Clackamas\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.430095, -122.570703\",\n            \"Access\": \"\",\n            \"flavor\": \"K9 at attention guarding a fallen officer\\nhttp://www.clackamas.us/sheriff/pressreleases/2017-05-08-CCSOPR-LEMemorialPlaza.\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs127.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS272\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Astoria NEMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"Marine Dr and Columbia Ave - Median\",\n            \"city\": \"Astoria\",\n            \"state\": \"OR\",\n            \"GPS\": \"46.18966 -123.84794\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys272.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS273\",\n            \"category\": \"Doughboys\",\n            \"name\": \"McMinnville NEMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"NE 6th & NE Evans - Courthouse Lawn - NW Corner\",\n            \"city\": \"McMinnville\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.21193 -123.19422\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys273.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS274\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Salem Paulding Doughboy\",\n            \"value\": 1,\n            \"address\": \"on the grounds of the Veterans Affairs - West side\",\n            \"city\": \"Salem\",\n            \"state\": \"OR\",\n            \"GPS\": \"44.94444 -123.02630\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys274.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS150\",\n            \"category\": \"Hueys\",\n            \"name\": \"64-13502 UH-1 - McMinnville\",\n            \"value\": 1,\n            \"address\": \"500 NE Capt Michael K Smith Way\",\n            \"city\": \"McMinnville\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.203417, -123.143200\",\n            \"Access\": \"\",\n            \"flavor\": \"Evergreen Air Museum\\nhttp://www.evergreenmuseum.org/\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys150.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS151\",\n            \"category\": \"Hueys\",\n            \"name\": \"70-16351 UH-1 - Canby\",\n            \"value\": 1,\n            \"address\": \"900 block SW 1st Ave\",\n            \"city\": \"Canby\",\n            \"state\": \"OR\",\n            \"GPS\": \"45.257133, -122.701783\",\n            \"Access\": \"\",\n            \"flavor\": \"Vietnam Era Veterans Memorial\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys151.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS251\",\n            \"category\": \"Hueys\",\n            \"name\": \"74-22539 UH-1 - Salem\",\n            \"value\": 1,\n            \"address\": \"2100 Turner Rd SE\",\n            \"city\": \"Salem\",\n            \"state\": \"OR\",\n            \"GPS\": \"44.913925, -122.999496\",\n            \"Access\": \"\",\n            \"flavor\": \"McNary Field\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys251.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS312\",\n            \"category\": \"Hueys\",\n            \"name\": \"62-12369 UH-1H - Combat Helicopters LLC\",\n            \"value\": 1,\n            \"address\": \"237 Hambletonian Dr\",\n            \"city\": \"Eugene\",\n            \"state\": \"OR\",\n            \"GPS\": \"\",\n            \"Access\": \"\",\n            \"flavor\": \"Touring Huey based out of Eugene Oregon - Will be seen at various locations across the country\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys312.jpg\"\n        },\n        {\n            \"bonusCode\": \"PARKS85\",\n            \"category\": \"Parks\",\n            \"name\": \"Lewis & Clark NHP\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Astoria\",\n            \"state\": \"OR\",\n            \"GPS\": \"46.134310,-123.880256\",\n            \"Access\": \"\",\n            \"flavor\": \"NHP\\nhttps://www.nps.gov/lewi/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks85.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA1\",\n            \"category\": \"TOH\",\n            \"name\": \"Protection Of The Flag Memorial\",\n            \"value\": 1,\n            \"address\": \"Academy Park\",\n            \"city\": \"Athens\",\n            \"state\": \"PA\",\n            \"GPS\": \"41.951185, -76.516012\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Immediately across the street from this memorial is the Tioga Point Museum. Created in 1895, this museum was built to give a permanent home to the wealth of history, archaeology, and the art and artifacts of world cultures. Open Tuesdays, Thursdays and the first Saturday of the month. If you stop in, introduce yourself to Maddie as a Tour of Honor rider, sheâs waiting for you.\",\n            \"imageName\": \"2019pa1.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Soldiers and Sailors Memorial\",\n            \"value\": 1,\n            \"address\": \"102 S Allegheny St.\",\n            \"city\": \"Bellefonte\",\n            \"state\": \"PA\",\n            \"GPS\": \"40.912103, -77.777754\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre hungry, the locals have some advice. Take a quick look up and down Allegheny St. from where you stand in front of the memorial. Bellefonte has many options for your culinary delights, including the Blonde Bistro and the Bellefonte Wok. Also, the Governorâs Pub is on West High St. and Bonfatttoâs is on Park Place.\",\n            \"imageName\": \"2019pa2.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Medal of Honor â Michael Dougherty\",\n            \"value\": 1,\n            \"address\": \"675 Jefferson Ave.\",\n            \"city\": \"Bristol\",\n            \"state\": \"PA\",\n            \"GPS\": \"40.105671, -74.852218\",\n            \"Access\": \"24/7, parking across the street, two photos may be required.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019pa3.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA4\",\n            \"category\": \"TOH\",\n            \"name\": \"Champion Of Democracy -- Joe Palooka Memorial\",\n            \"value\": 1,\n            \"address\": \"PA-309 just north of Pine Run Rd.\",\n            \"city\": \"Hanover\",\n            \"state\": \"PA\",\n            \"GPS\": \"41.196333, -75.889200\",\n            \"Access\": \"24/7. Caution: gravel parking lot.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The monument is less than two miles south of Wilkes-Barre city limits. Wilkes-Barre boasts over 130 restaurants including Italian, seafood, barbeque, pizza, steakhouses, Mexican, Chinese and Greek.\",\n            \"imageName\": \"2019pa4.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA5\",\n            \"category\": \"TOH\",\n            \"name\": \"9-11 Memorial\",\n            \"value\": 1,\n            \"address\": \"206 Wildlife Lodge Rd.\",\n            \"city\": \"Lower Burrell\",\n            \"state\": \"PA\",\n            \"GPS\": \"40.582598, -79.711062\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If you scoot south on Wildlife Lodge Road less than a half of a mile, across Route 56, you will see VFW Post 92. They have a Huey on display in their front yard. It is listed as â64-14175 UH-1 - New Kensingtonâ in Eric Marshallâs gpx file of known Huey locations shared on the Tour of Honor website.\",\n            \"imageName\": \"2019pa5.jpg\"\n        },\n        {\n            \"bonusCode\": \"PA6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 