s Competition. All guests over 21 years of age are invited for a free tour of the craft whiskey and moonshine distillery.\",\n            \"imageName\": \"2019sc1.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC2\",\n            \"category\": \"TOH\",\n            \"name\": \"Felix âDocâ Blanchard Memorial\",\n            \"value\": 1,\n            \"address\": \"Flag Park\",\n            \"city\": \"Bishopville\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.220229, -80.246154\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Within sight of the memorial is the Lee County Veterans Museum, located next to the South Carolina Cotton Museum at 121 W. Cedar Lane. The exhibits trace the history of American conflicts with artifacts and military memorabilia provided by Lee County veterans and families. A series of exhibits tell the history of six branches of the uniformed service, including a permanent exhibit honoring Lee Countyâs Medal of Honor recipient, James Davison Heriot. Special remembrances of deceased veterans are represented in the Lest We Forget section. The Lee County Veterans Museum provides quarters for the American Legion Post 29 and Veterans of Foreign Wars Post 3096. Museum hours: Monday-Friday 10am-4:30pm, Saturday 10am-4pm.\",\n            \"imageName\": \"2019sc2.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC3\",\n            \"category\": \"TOH\",\n            \"name\": \"âVikings of Denmarkâ\",\n            \"value\": 1,\n            \"address\": \"5122 Carolina Hwy.\",\n            \"city\": \"Denmark\",\n            \"state\": \"SC\",\n            \"GPS\": \"33.320648, -81.142967\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Southern Soul Restaurant 910 W Hagood St. Open Thursday-Saturday. Great reviews! Family owned business specializing in Soul food, BBQ, and more!\",\n            \"imageName\": \"2019sc3.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Appreciation Park\",\n            \"value\": 1,\n            \"address\": \"200 S Logan St.\",\n            \"city\": \"Gaffney\",\n            \"state\": \"SC\",\n            \"GPS\": \"35.072413, -81.653943\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"American Legion Post 109 and the Cherokee County Veterans Museum is located next to the Memorial. Museum is open Saturdays 9amâ11am and Sundays 2pm-4pm. Nearby Huey alert.\",\n            \"imageName\": \"2019sc4.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Cafe & Grille\",\n            \"value\": 1,\n            \"address\": \"3544 Northgate Dr.\",\n            \"city\": \"Myrtle Beach\",\n            \"state\": \"SC\",\n            \"GPS\": \"33.684935, -78.962748\",\n            \"Access\": \"24/7\",\n         