avor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"South Carolina Military Museum is only 18 miles away. Located in the capital city of Columbia, the South Carolina Military Museum is one of the largest National Guard museums in the country. The mission is to honor and chronicle the South Carolina citizen soldier and this State\'s martial tradition from its colonial founding in 1670 to present-day operations. Featuring an impressive collection of artifacts, displays and exhibits, the museum tells the story of the South Carolina militia, its evolution into the National Guard, and its important role today as a force multiplier for the United States Army and Air Force.\",\n            \"imageName\": \"2019sc7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS90\",\n            \"category\": \"War Dogs\",\n            \"name\": \"War Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"700 Hampton St.\",\n            \"city\": \"Columbia\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.002541, -81.042183\",\n            \"Access\": \"\",\n            \"flavor\": \"\\nhttps://goo.gl/kdE7S6\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs90.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS119\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Anderson SC EMV Doughboy 2011 Copy\",\n            \"value\": 1,\n            \"address\": \"1301 Greenville ST\",\n            \"city\": \"Anderson\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.525122,-82.642014\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": 