hether standards are met.\",\n            \"madeinamerica\": \"Bolivar was originally called Hatchie Town until 1825, when it was renamed by act of State Legislature. Bolivar was named for General Simon Bolivar, the South American patriot and liberator.\",\n            \"imageName\": \"2019tn1.jpg\"\n        },\n        {\n            \"bonusCode\": \"TN2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"4 Court Sq.\",\n            \"city\": \"Charlotte\",\n            \"state\": \"TN\",\n            \"GPS\": \"36.178173, -87.339679\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre in Charlotte at breakfast time, Monday-Friday, closed on weekends, check out the Courtside CafÃ©, 3806 Hwy 48 N. If you do, itâs almost guaranteed youâll want to come back.\",\n            \"imageName\": \"2019tn2.jpg\"\n        },\n        {\n            \"bonusCode\": \"TN3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Across from 8961 US-70\",\n            \"city\": \"Crab Orchard\",\n            \"state\": \"TN\",\n            \"GPS\": \"35.909177, -84.893968\",\n            \"Access\": \"24/7. Traffic is usually light along Hwy 70, but no real shoulder to park. Suggest parking in driveway.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Crab Orchard\'s position in a gap in the Crab Orchard Mountains made it an early \\\"gateway\\\" to the Cumberland area as early as the late 18th century. Pioneers passing through the area named it for its abundance of wild crab apple trees. In the 1780s, a road was built through the gap to help provide protection for travelers migrating from East Tennessee to the Nashville area.\",\n            \"imageName\": \"2019tn3.jpg\"\n        },\n        {\n            \"bonusCode\": \"TN4\",\n            \"category\": \"TOH\",\n            \"name\": \"Medal of Honor Memorial\",\n            \"value\": 1,\n            \"address\": \"210 Lawyers Bldg. on Main St.\",\n            \"city\": \"Jasper\",\n            \"state\": \"TN\",\n            \"GPS\": \"35.074250, -85.625413\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Jasper stands at the gateway to the beautiful Sequatchie Valley. Once, part of the Cherokee Nation, Jasper was established in 1820 with land that was deeded for $1 from Elizabeth \\\"Betsy\\\" Pack, daughter of Cherokee Chief John Lowery and beloved Cherokee Woman Nannie Watts.\",\n            \"imageName\": \"2019tn4.jpg\"\n        },\n        {\n            \"bonusCode\": \"TN5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Freedom Park\",\n            \"city\": \"Ridgely\",\n            \"state\": \"TN\",\n            \"GPS\": \"36.264814, -89.486345\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are 