w.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For a decent burger, visit Zipâs Drive-in at 1005 S Main St.\",\n            \"imageName\": \"2019wa2.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Tribute\",\n            \"value\": 1,\n            \"address\": \"Griffintown Park\",\n            \"city\": \"Ferndale\",\n            \"state\": \"WA\",\n            \"GPS\": \"48.850956, -122.590109\",\n            \"Access\": \"24/7, daylight recommended due to limited lighting. Two photos may be required due to limited parking choices.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For an excellent frozen treat, visit Edaleen Dairy Store at 5905 Portal Way.\",\n            \"imageName\": \"2019wa3.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA4\",\n            \"category\": \"TOH\",\n            \"name\": \"Vietnam Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Cable Bridge Park\",\n            \"city\": \"Kennewick\",\n            \"state\": \"WA\",\n            \"GPS\": \"46.214122, -119.106759\",\n            \"Access\": \"24/7, parking is limited so two photos may be required.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met\",\n            \"madeinamerica\": \"A couple of places to try in Kennewick: Foodies Brick & Mortar (308 W Kennewick Ave.) for good bar food, or further west: Between the Buns (3902 W Clearwater Ave.) for an outstanding hot dog.\",\n            \"imageName\": \"2019wa4.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA5\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 141\",\n            \"value\": 1,\n            \"address\": \"14096 WA-525\",\n            \"city\": \"Langley\",\n            \"state\": \"WA\",\n            \"GPS\": \"47.999425, -122.451232\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Thereâs no shortage of fine coffee in the area: Useless Bay Coffee Company at 121 2nd St., Mukilteo Coffee Roasters at 3228 Lake Leo Way, or Whidbey Pies & CafÃ© at 765 Wonn Rd. (in nearby Greenbank).\",\n            \"imageName\": \"2019wa5.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA6\",\n            \"category\": \"TOH\",\n            \"name\": \"9-11 Memorial\",\n            \"value\": 1,\n            \"address\": \"Civic Center Park\",\n            \"city\": \"Moses Lake\",\n            \"state\": \"WA\",\n            \"GPS\": \"47.131249, -119.271005\",\n            \"Access\": \"24/7, but daylight recommended due to limited lighting, two photos may be required due to parking. Donât drive on sidewalk.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.to