(18, '2019-04-02 11:53:48', '1', '{\n    \"meta\": {\n        \"fileName\": \"Tour of Honor Bonus Listing\",\n        \"version\": \"19.4.1\"\n    },\n    \"bonuses\": [\n        {\n            \"bonusCode\": \"AK1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Jack Henry Post 1\",\n            \"value\": 1,\n            \"address\": \"Anchorage, Alaska\",\n            \"city\": \"Anchorage, AL Post\",\n            \"state\": \"\",\n            \"GPS\": \"61.198649, -149.899567\",\n            \"Access\": \"24/7, unrestricted.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019ak1.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK2\",\n            \"category\": \"TOH\",\n            \"name\": \"Anchorage, Alaska\",\n            \"value\": 1,\n            \"address\": \"Rememberance Circle off Merrill Field Dr.\",\n            \"city\": \"Anchorage\",\n            \"state\": \"\",\n            \"GPS\": \"61.208368,-149.841395\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"You want to make hotel reservations in Anchorage as far ahead as possible. Smaller towns and villages not so much, but the farther ahead you plan, the better prices you will normally receive. TripAdvisor.com is your friend in Alaska.\",\n            \"imageName\": \"2019ak2.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Denali Park\",\n            \"city\": \"Byer\'s Lake]]>\",\n            \"state\": \"\",\n            \"GPS\": \"62.746286,-150.128109\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Denali State Park is 325,240 acres, almost one-half the size of Rhode Island. The park provides visitors with a great variety of recreational opportunities, ranging from roadside camping to extreme wilderness exploration.\",\n            \"imageName\": \"2019ak3.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK5\",\n            \"category\": \"TOH\",\n            \"name\": \"Lost Seafarers Memorial\",\n            \"value\": 1,\n            \"address\": \"End of Homer Spit\",\n            \"city\": \"Homer\",\n            \"state\": \"\",\n            \"GPS\": \"59.600677,-151.418815\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Located in old town Homer, the biker-friendly Driftwood Inn is recommended. Clean, reasonably priced and a variety of room types from under $100 to over $200+. H.O.G. Anchorage has a couple runs to Homer every year and the Driftwood puts out âHarley Parking Onlyâ signs during those times. Right on the water, it also has great views. In old town Homer.Â https://goo.gl/adfjfV\",\n            \"imageName\": \"2019ak5.jpg\"\n        },\n        {\n            \"bonusCode\": \"CA6\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"Memorial Park\",\n            \"city\": \"Susanville\",\n            \"state\": \"\",\n            \"GPS\": \"40.419095, -120.655436\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre hungry, try the well-reviewed Lassen Ale Works at the Pioneer Saloon. Just a couple blocks west of the gun at 724 Main St.\",\n            \"imageName\": \"2019ca6.jpg\"\n        },\n        {\n            \"bonusCode\": \"CO2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"1801 Riverside Ave.\",\n            \"city\": \"Fort Collins\",\n            \"state\": \"\",\n            \"GPS\": \"40.562950, -105.047781\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For those in the RTE-USA Challenge take a fun ride out to The Mishawaka at 13714 Poudre Canyon Rd. in Bellvue.\",\n            \"imageName\": \"2019co2.jpg\"\n        },\n        {\n            \"bonusCode\": \"GA5\",\n            \"category\": \"TOH\",\n            \"name\": \"USS George Bancroft Submarine Sail\",\n            \"value\": 1,\n            \"address\": \"Nr. St Marys Rd. and Charlie Smith Sr Hwy.\",\n            \"city\": \"St. Maryâs\",\n            \"state\": \"\",\n            \"GPS\": \"30.781917, -81.575782\",\n            \"Access\": \"24/7, outside base guard station\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019ga5.jpg\"\n        },\n        {\n            \"bonusCode\": \"HI6\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial Natatorium\",\n            \"value\": 1,\n            \"address\": \"2815 Kalakaua Ave.\",\n            \"city\": \"Waikiki\",\n            \"state\": \"\",\n            \"GPS\": \"21.264526, -157.822081\",\n            \"Access\": \"24/7, be mindful of pedestrians\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"No visit to Hawaii is complete without trying the malasadas. This Portuguese donut pillow delight was made famous by Leonard\'s Bakery, so why not buy from the source atÂ 933 Kapahulu Ave. It\'s also on the RTE-USA Challenge