     \"city\": \"McMinnville\",\n            \"state\": \"\",\n            \"GPS\": \"45.201851, -123.176580\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The world-renowned Evergreen Aviation and Space Museum is just seven minutes east of here. The Spruce Goose, a SR-71 Blackbird, and the largest collection of Vietnam-era military aircraft is on display. A $12 admission ticket ($27 value) *may* be available here: https://bit.ly/2LVTXKk. If not available for some reason, ask for AAA and veterans discounts at the door.\",\n            \"imageName\": \"2019or4.jpg\"\n        },\n        {\n            \"bonusCode\": \"VA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans of the Battle of the Bulge\",\n            \"value\": 1,\n            \"address\": \"Ingalls Rd. and Ruckman Rd.\",\n            \"city\": \"Ft. Monroe\",\n            \"state\": \"\",\n            \"GPS\": \"37.004075, -76.311235\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Try Firehouse Coffee, located in a former 1880s firehouse, just across the park from the memorial.\",\n            \"imageName\": \"2019va2.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC1\",\n            \"category\": \"TOH\",\n            \"name\": \"2nd Infantry Division WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"Across from 200 17th St. SW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"\",\n            \"GPS\": \"38.892570, -77.037968\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Standing in the shadow of the Washington Monument, the nearby memorials on the National Mall as well as those in Arlington across the river, including the National Cemetery are must see stops.\",\n            \"imageName\": \"2019dc1.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Headquarters-DC\",\n            \"value\": 1,\n            \"address\": \"1608 K St. NW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"\",\n            \"GPS\": \"38.902320, -77.037269\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Monuments and memorials abound in Washington DC but visits to the Smithsonian Museums on the National Mall should not be missed. The National Zoo and the Kennedy Centerâs Millennium Stage (free concerts at 6pm) offer entertaining respite from hours of educational immersion at the museums.\",\n            \"imageName\": \"2019dc2.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC3\",\n            \"category\": \"TOH\",\n            \"name\": \"Freedom Bell\",\n            \"value\": 1,\n            \"address\": \"Union Station Columbus Monument Dr. NE\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"\",\n            \"GPS\": \"38.896565, -77.006535\",\n            \"Access\": \"24/7, two photos required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Park your bike in the garage on the corner and walk to the Capitol southwest of this spot. Of course, thereâs the Botanic Garden and the National Mall with the Smithsonian Museums across from that and then the Washington Monument further down. A visit to the National Museum of African American History and Culture is highly recommended.\",\n            \"imageName\": \"2019dc3.jpg\"\n        },\n        {\n            \"bonusCode\": \"DC4\",\n            \"category\": \"TOH\",\n            \"name\": \"Mahatma Gandhi Peace Memorial\",\n            \"value\": 1,\n            \"address\": \"2107 Massachusetts Ave. NW\",\n            \"city\": \"Washington, DC\",\n            \"state\": \"\",\n            \"GPS\": \"38.911019, -77.046961\",\n            \"Access\": \"24/7, two photos may be required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Across the street youâll find the Society of the Cincinnati where youâll find a treasure trove of information on the Revolutionary War. https://bit.ly/1IwMbyK\",\n            \"imageName\": \"2019dc4.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE1\",\n            \"category\": \"TOH\",\n            \"name\": \"WWII Memorial\",\n            \"value\": 1,\n            \"address\": \"1 The Circle\",\n            \"city\": \"Georgetown, DE\",\n            \"state\": \"\",\n            \"GPS\": \"38.690133, -75.385183\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Marvel Carriage Museum is an odd little place featuring carriages, telephones, stage coaches, victrolas and other Georgetown historical items. https://bit.ly/2MP5gEV\",\n            \"imageName\": \"2019de1.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE2\",\n            \"category\": \"TOH\",\n            \"name\": \"Korean War Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial Park\",\n            \"city\": \"New Castle, DE\",\n            \"state\": \"\",\n            \"GPS\": \"39.694395, -75.550080\",\n            \"Access\": \"Dawn to dusk, two photos required\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Other memorials in the plaza include the WWII Submariners Memorial, Desert Shield/Desert Storm Memorial, Vietnam Memorial and Wounded Combat Veterans Memorial.\",\n            \"imageName\": \"2019de2.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE3\",\n            \"category\": \"TOH\",\n            \"name\": \"Life Saving Memorial and Museum\",\n            \"value\": 1,\n            \"address\": \"25039 Coastal Hwy.\",\n            \"city\": \"Rehoboth Beach, DE\",\n            \"state\": \"\",\n            \"GPS\": \"38.634102, -75.067013\",\n            \"Access\": \"24/7, Caution: gravel in parking area\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Check out the WWII Observation Tower in Dewey Beach only a few miles up the Coastal Highway.\",\n            \"imageName\": \"2019de3.jpg\"\n        },\n        {\n            \"bonusCode\": \"DE4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 14\",\n            \"value\": 1,\n            \"address\": \"107 W Glenwood Ave.\",\n            \"city\": \"Smyrna, DE\",\n            \"state\": \"\",\n            \"GPS\": \"39.301915, -75.611831\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Located in a former 1940s movie theater, the Painted Stave Distillery creates small batch spirits from locally sourced ingredients and offers tours. https://bit.ly/2WxY5oM\",\n            \"imageName\": \"2019de4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"N Rogers St. and N Parke St.\",\n            \"city\": \"Aberdeen, MD\",\n            \"state\": \"\",\n            \"GPS\": \"39.513168, -76.163650\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"A great lunch platter can be had at Grumpyâs Bar & Grille located in the Aberdeen Travelodge Hotel. Try the open-faced hot sandwiches. https://bit.ly/2SfJUpc\",\n            \"imageName\": \"2019md1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 96\",\n            \"value\": 1,\n            \"address\": \"18 S Maple Ave.\",\n            \"city\": \"Brunswick, MD\",\n            \"state\": \"\",\n            \"GPS\": \"39.312333, -77.627074\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Harpers Ferry National Historic Park (https://bit.ly/2MHWwQG) is just over the state line as is the Appalachian Trail Conservancy HQ & Visitors Center (https://bit.ly/2RWO0TT) â both worth a stop while youâre in the area. Note that Harpers Ferry NPS is part of the National Parks Tour https://bit.ly/2FZysIx.\",\n            \"imageName\": \"2019md2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD3\",\n            \"category\": \"TOH\",\n            \"name\": \"Gulf War Memorial\",\n            \"value\": 1,\n            \"address\": \"Gulf Memorial Dr. and E Union St.\",\n            \"city\": \"Cumberland, MD\",\n            \"state\": \"\",\n            \"GPS\": \"39.651247, -78.758013\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The C&O Canal National Historic Park is an education in the history and technology of this famous canal â thereâs a model of the famous Paw Paw Tunnel (or you can go see & walk the real one â with its 6 million bricks and nearly Â¾ miles of tunnel trailway). https://bit.ly/2HJsIV4\",\n            \"imageName\": \"2019md3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MD4\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Monument\",\n            \"value\": 1,\n            \"address\": \"Across from 22696 Washington St.\",\n            \"city\": \"Leonardtown, MD\",\n            \"state\": \"\",\n            \"GPS\": \"38.290850, -76.635917\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While youâre in Leonardtown you should stop by the historical society (Moll Dyer Road) and see Moll Dyerâs Rock. Yep, itâs a rock. But itâs the story you go for â legend has it that Moll Dyer was a witch who was chased from her home on a cold winter night in 1697 and found frozen to the rock, her handprints permanently embedded. Stories say her spirit haunts the land, looking for the men who forced her from her home.\",\n            \"imageName\": \"2019md4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ1\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"413 2nd St.\",\n            \"city\": \"Belvidere, NJ\",\n            \"state\": \"\",\n            \"GPS\": \"40.827346, -75.077108\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Itâs not a stainless-steel classic, but Uncle Buckâs Diner (2 Market St) is an original, complete with spinning stools at the counter.\",\n            \"imageName\": \"2019nj1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 351\",\n            \"value\": 1,\n            \"address\": \"1400 Bay Blvd.\",\n            \"city\": \"Seaside Heights, NJ\",\n            \"state\": \"\",\n            \"GPS\": \"39.947525, -74.078150\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Time on your hands, nowhere to go, no schedule to keep? Scoot over to the Seaside Heights Boardwalk (https://bit.ly/2RuPgbx) and Van Holtenâs Chocolates, a 100+ year old candy shop. https://bit.ly/2t0ryue\",\n            \"imageName\": \"2019nj2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ3\",\n            \"category\": \"TOH\",\n            \"name\": \"Centennial Memorial\",\n            \"value\": 1,\n            \"address\": \"271 Clarksville Rd.\",\n            \"city\": \"West Windsor, NJ\",\n            \"state\": \"\",\n            \"GPS\": \"40.305257, -74.633034\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Right over in Trenton youâll find the Old Barracks Museum, one of George Washingtonâs military hospitals and now featuring extensive exhibits about the Revolutionary War. https://bit.ly/2hli8RH\",\n            \"imageName\": \"2019nj3.jpg\"\n        },\n        {\n            \"bonusCode\": \"NJ4\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"Ashbrooke Ave. (betw Mill & S Main Sts.)\",\n            \"city\": \"Woodstown, NJ\",\n            \"state\": \"\",\n            \"GPS\": \"39.644595, -75.328989\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Salem County Fair is Aug 7-10 this year, but check the website for events throughout the year. https://bit.ly/2RwR7wG\",\n            \"imageName\": \"2019nj4.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT1\",\n            \"category\": \"TOH\",\n            \"name\": \"Josh Piver Memorial\",\n            \"value\": 1,\n            \"address\": \"Stonington Point\",\n            \"city\": \"Stonington, CT\",\n            \"state\": \"\",\n            \"GPS\": \"41.327883, -71.905183\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are vineyards near here, and for lighthouse collectors, thereâs the Old Lighthouse Museum for a tour and a chance to bag another lighthouse. Thereâs also the Captain Nathaniel Brown Palmer House (and lighthouse) so two in one town. https://bit.ly/2MIULCV\",\n            \"imageName\": \"2019ct1.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT2\",\n            \"category\": \"TOH\",\n            \"name\": \"Navy Chaplain Memorial\",\n            \"value\": 1,\n            \"address\": \"74 W Main St.\",\n            \"city\": \"Waterbury, CT\",\n            \"state\": \"\",\n            \"GPS\": \"41.556951, -73.042181\",\n            \"Access\": \"24/7, daylight hours suggested\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The book, âIn Harmâs Wayâ by Doug Stanton tells the story of the USS Indianapolis and is a great read while youâre on the Tour. Besides taking a tour of the Basilica, a ride over to the corner of the Chase Parkway takes you to the Pilgrim Memorial, an intricately carved 60 foot long French granite memorial to the Pilgrims who helped found the city.\",\n            \"imageName\": \"2019ct2.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT3\",\n            \"category\": \"TOH\",\n            \"name\": \"Lone Sailor Memorial\",\n            \"value\": 1,\n            \"address\": \"4 Palace St.\",\n            \"city\": \"West Haven, CT\",\n            \"state\": \"\",\n            \"GPS\": \"41.257897, -72.948671\",\n            \"Access\": \"24/7, daylight hours suggested\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just to the west, Jimmies of Savin Rock is a full service restaurant where if youâre lucky, theyâll make you an original split hot-dog, their own invention nearly 100 years ago when it was simply a roadside hot-dog stand. https://bit.ly/2ShNter\",\n            \"imageName\": \"2019ct3.jpg\"\n        },\n        {\n            \"bonusCode\": \"CT4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 86\",\n            \"value\": 1,\n            \"address\": \"Wilton, Connecticut\",\n            \"city\": \"Wilton, CT\",\n            \"state\": \"\",\n            \"GPS\": \"41.193514, -73.431339\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Weir Farm National Historic Site is the only national park for an artist and worth a tour. https://bit.ly/2uaRtBg\",\n            \"imageName\": \"2019ct4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA1\",\n            \"category\": \"TOH\",\n            \"name\": \"Massachusetts Fallen Firefighters Memorial\",\n            \"value\": 1,\n            \"address\": \"24 Beacon St.\",\n            \"city\": \"Boston, MA\",\n            \"state\": \"\",\n            \"GPS\": \"42.358760, -71.063182\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are hundreds of sights, museums, restaurants and shopping opportunities in Boston. Walk the Freedom Trail following the steps painted on the sidewalks, or take the Boston Pizza Tour (https://bit.ly/2mjWXUp) through the famous Italian North End. Fenway Park or the USS Constitution are close by as is Faneuil Hall and Quincy Market. Take an amphibious Duck Boat tour (https://bit.ly/2SX7Zhc) of the streets and harbor. Whatever you do, donât just ride in & ride out. Take advantage of all the city has to offer https://bit.ly/2jmjodu\",\n            \"imageName\": \"2019ma1.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Operation Iraqi Freedom Memorial\",\n            \"value\": 1,\n            \"address\": \"Franklin Town Common\",\n            \"city\": \"Franklin, MA\",\n            \"state\": \"\",\n            \"GPS\": \"42.089333, -71.401700\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre staying over, the British Beer Company is the place for a variety of beer on tap (and bottles) and good pub food. https://bit.ly/2HEeK6K\",\n            \"imageName\": \"2019ma2.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Revolutionary War Memorial\",\n            \"value\": 1,\n            \"address\": \"Main St. and Walker St.\",\n            \"city\": \"Lenox, MA\",\n            \"state\": \"\",\n            \"GPS\": \"42.356850, -73.285067\",\n            \"Access\": \"24/7, donât try to park at the island, may require two photos\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Nearby Tanglewood is the summer home of the Boston Symphony Orchestra and several other prominent musicians (James Taylor, Yo-Yo Ma, Kristine Opolais and John Williams) playing under the stars. https://www.bso.org\",\n            \"imageName\": \"2019ma3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MA4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 138\",\n            \"value\": 1,\n            \"address\": \"175 Main St.\",\n            \"city\": \"Spencer, MA\",\n            \"state\": \"\",\n            \"GPS\": \"42.245109, -71.991337\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Kostas CafÃ© (31 Pleasant St.), Five Loaves Bakery (https://bit.ly/2GcmWZH) and Spencer Pizza House (https://bit.ly/2t0xxPG) are all great bets for a good meal at a reasonable price.\",\n            \"imageName\": \"2019ma4.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME1\",\n            \"category\": \"TOH\",\n            \"name\": \"Law Enforcement Memorial\",\n            \"value\": 1,\n            \"address\": \"230 State St.\",\n            \"city\": \"Augusta, ME\",\n            \"state\": \"\",\n            \"GPS\": \"44.305647, -69.781444\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are other memorials in the State Capitol grounds â Firefighters and EMS first responders are also honored in memorials a little south of this one.\",\n            \"imageName\": \"2019me1.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME2\",\n            \"category\": \"TOH\",\n            \"name\": \"Maine Vietnam War Memorial\",\n            \"value\": 1,\n            \"address\": \"405 Perry Rd.\",\n            \"city\": \"Bangor, ME\",\n            \"state\": \"\",\n            \"GPS\": \"44.785508, -68.804164\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Cole Land Transportation Museum contains displays of land transportation vehicles and exhibits including the worldâs largest indoor display of snow plows as well as fire engines, farm vehicles, snowmobiles, trucks, cars and even a recreated train station. The museum is only steps away from the memorial and open from 9-5 daily. Highly recommended for gearheads.\",\n            \"imageName\": \"2019me2.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME3\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 94\",\n            \"value\": 1,\n            \"address\": \"218 Pritham Ave.\",\n            \"city\": \"Greenville, ME\",\n            \"state\": \"\",\n            \"GPS\": \"45.459155, -69.602318\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"For a peek into the life of a lumber town, this town in the heart of Maineâs forests, offers the Moosehead Historical Society Museum. Check out the exhibits in the Aviation museum as well for insights into the adventures of bush pilots in this remote part of the country. https://bit.ly/2RtdL99\",\n            \"imageName\": \"2019me3.jpg\"\n        },\n        {\n            \"bonusCode\": \"ME4\",\n            \"category\": \"TOH\",\n            \"name\": \"Double Eagle II Monument\",\n            \"value\": 1,\n            \"address\": \"140 Spragueville Rd.\",\n            \"city\": \"Presque Isle, ME\",\n            \"state\": \"\",\n            \"GPS\": \"46.626820, -68.021254\",\n            \"Access\": \"24/7. Caution: gravel turnout\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If you came up Rt 1 (about the only way), you may have noticed the odd planet model perched atop a pole roadside. Hop over to U of Maine and see the Sun. This is the only scale model of the solar system in the United States (maybe the world). On the way back, keep an eye out until you get to Pluto at the visitorâs center in Houlton.\",\n            \"imageName\": \"2019me4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH1\",\n            \"category\": \"TOH\",\n            \"name\": \"Fallen Firefighters Memorial\",\n            \"value\": 1,\n            \"address\": \"98 Smokey Bear Blvd.\",\n            \"city\": \"Concord, NH\",\n            \"state\": \"\",\n            \"GPS\": \"43.208696, -71.478270\",\n            \"Access\": \"24/7, donât park in the FD driveway for obvious reasons\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Of course, the State House and the nearby NH Historical Society are steeped in history, but a quick trip to the McAuliffe-Shepard Discovery Center will take you to the stars with New Hampshireâs own astronauts Alan Shepard and Christa McAuliffe. https://bit.ly/2WydG7R\",\n            \"imageName\": \"2019nh1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH2\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"10 Front St.\",\n            \"city\": \"Exeter, NH\",\n            \"state\": \"\",\n            \"GPS\": \"42.980968, -70.946290\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Stop by for a tour at the American Independence Museum for displays and artifacts from before there was a United States. Watch for one of the many historical re-enactments held here each summer. https://bit.ly/2sYXsY3\",\n            \"imageName\": \"2019nh2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH3\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 17\",\n            \"value\": 1,\n            \"address\": \"206 State St.\",\n            \"city\": \"Groveton, NH\",\n            \"state\": \"\",\n            \"GPS\": \"44.606652, -71.525517\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The North Country Restaurant (12 Main St) is the place in town for breakfast â omelettes, pancakes, French toast (try the raisin bread version!) hit the spot. This is a townie favorite so you know youâre in good hands.\",\n            \"imageName\": \"2019nh3.jpg\"\n        },\n        {\n            \"bonusCode\": \"NH4\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"Schouler Park\",\n            \"city\": \"North Conway, NH\",\n            \"state\": \"\",\n            \"GPS\": \"44.052417, -71.127972\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Take a few hours and ride the Kancamagus Highway (Rt 112 from Center Conway to North Woodstock) and then turn around and ride it again. Itâs one of the best riding roads in New England. LL Bean has a factory store on Rt 16 or you can head across the state line to Maine and to the factory itself.\",\n            \"imageName\": \"2019nh4.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"374 N Rd.\",\n            \"city\": \"Hope, RI\",\n            \"state\": \"\",\n            \"GPS\": \"41.736591, -71.563786\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Billâs Place is only a couple of miles away in West Warwick is a local favorite for Greek specialties, grinders and pizza. https://bit.ly/2HEm8iu\",\n            \"imageName\": \"2019ri1.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Deerfield Park\",\n            \"city\": \"Smithfield, RI\",\n            \"state\": \"\",\n            \"GPS\": \"41.882084, -71.551392\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Jaswellâs Farm is the place to stop for fresh apple cider, pie and warm cider donuts. https://bit.ly/2G5Wl1l\",\n            \"imageName\": \"2019ri2.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Broad St. and Grove Ave.\",\n            \"city\": \"Westerly, RI\",\n            \"state\": \"\",\n            \"GPS\": \"41.377317, -71.827733\",\n            \"Access\": \"24/7, two photos required for parking reasons\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"A stop at the Malted Barley will get you only two things â beer of all kinds, and pretzels; some of the best in the region. https://bit.ly/2SdQqwI\",\n            \"imageName\": \"2019ri3.jpg\"\n        },\n        {\n            \"bonusCode\": \"RI4\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Fairmount Post 85\",\n            \"value\": 1,\n            \"address\": \"870 River St.\",\n            \"city\": \"Woonsocket, RI\",\n            \"state\": \"\",\n            \"GPS\": \"42.007001, -71.527636\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Museum of Work and Culture is a local museum focused on the history of French-Canadians and workers in the RI & New England area. https://bit.ly/1E1tAby\",\n            \"imageName\": \"2019ri4.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Church St. and Village Sq.\",\n            \"city\": \"Barton, VT\",\n            \"state\": \"\",\n            \"GPS\": \"44.750761, -72.179985\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"This far north, youâll need to tread a little out of town for sights and eats, unless youâre here before Parsonâs Corner (14 Glover Rd) closes and then youâll want to stop there for breakfast or lunch. Great local place.\",\n            \"imageName\": \"2019vt1.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 13\",\n            \"value\": 1,\n            \"address\": \"255 Northside Dr.\",\n            \"city\": \"Bennington, VT\",\n            \"state\": \"\",\n            \"GPS\": \"42.901094, -73.211675\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Bennington Battle Monument (on Monument Circle naturally) is modeled after the Washington Monument and dominates the view of Bennington. The Bennington Museum (75 Main St) has the worldâs largest collection of Grandma Moses paintings as well as extensive exhibits on Vermont and its history.\",\n            \"imageName\": \"2019vt2.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT3\",\n            \"category\": \"TOH\",\n            \"name\": \"Korea War Memorial\",\n            \"value\": 1,\n            \"address\": \"Main St. south of Center St.\",\n            \"city\": \"Rutland, VT\",\n            \"state\": \"\",\n            \"GPS\": \"43.606878, -72.971995\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The Vermont State Fair and Norman Rockwell Museum (https://bit.ly/2HHoKfK) are places to visit for fun, but skip the Dennyâs and the McDonaldâs chain places and sit down at Johnny Boyâs Pancake House for an omelet or maple pancakes where the syrup was tapped by neighbors nearby. https://bit.ly/2Se2w99\",\n            \"imageName\": \"2019vt3.jpg\"\n        },\n        {\n            \"bonusCode\": \"VT4\",\n            \"category\": \"TOH\",\n            \"name\": \"Honor Roll\",\n            \"value\": 1,\n            \"address\": \"Gage St. and Saxtons River Rd.\",\n            \"city\": \"Westminster, VT\",\n            \"state\": \"\",\n            \"GPS\": \"43.118659, -72.455066\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre a New Englander, you probably went to Santaâs Land in nearby Putney when you were a kid, go again while youâre in the neighborhood and relive a bit of your childhoodâs magic.\",\n            \"imageName\": \"2019vt4.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS1\",\n            \"category\": \"Hueys\",\n            \"name\": \"66-17044 UH-1 - Wasilla\",\n            \"value\": 1,\n            \"address\": \"3800 W Museum Dr\",\n            \"city\": \"Wasilla\",\n            \"state\": \"AK\",\n            \"GPS\": \"61.576867, -149.546148\",\n            \"Access\": \"\",\n            \"flavor\": \"Museum of Alaska Transportation and Industry\\nhttp://www.museumofalaska.org\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys1.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS2\",\n            \"category\": \"Hueys\",\n            \"name\": \"65-12849 UH-1 - Anchorage\",\n            \"value\": 1,\n            \"address\": \"4721 Aircraft Dr\",\n            \"city\": \"Anchorage*\",\n            \"state\": \"AK\",\n            \"GPS\": \"61.179111, -149.972604\",\n            \"Access\": \"\",\n            \"flavor\": \"Alaska Aviation Heritage Museum\\nhttp://www.alaskaairmuseum.org/\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys2.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS3\",\n            \"category\": \"Hueys\",\n            \"name\": \"66-00934 UH-1 - Fairbanks\",\n            \"value\": 1,\n            \"address\": \"2300 Airport Way\",\n            \"city\": \"Fairbanks*\",\n            \"state\": \"AK\",\n            \"GPS\": \"64.839445, -147.774935\",\n            \"Access\": \"\",\n            \"flavor\": \"Pioneer Air Museum\\nhttp://www.pioneerairmuseum.org/\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys3.jpg\"\n        },\n        {\n            \"bonusCode\": \"AK4\",\n            \"category\": \"TOH\",\n            \"name\": \"Alaska Siberia WWII Memorial\",\n            \"value\": 1,\n            