         \"name\": \"Veterans Memorial Park\",\n            \"value\": 1,\n            \"address\": \"1745 Washington St.\",\n            \"city\": \"Calistoga\",\n            \"state\": \"CA\",\n            \"GPS\": \"38.581367, -122.586368\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just west at the intersection of Hwy. 128 and Lincoln Blvd is Busterâs Original BBQ. Itâs popular with the locals and visitors with Southern-style smoked meats & sides, with indoor/outdoor seating. There\'s a good chance you\'ll see other motorcyclists there, too. 1207 Foothill Blvd. Open 7 days, 10am-7pm\",\n            \"imageName\": \"2019ca2.jpg\"\n        },\n        {\n            \"bonusCode\": \"CA3\",\n            \"category\": \"TOH\",\n            \"name\": \"Submarine Crews Memorial\",\n            \"value\": 1,\n            \"address\": \"Chico Cemetery\",\n            \"city\": \"Chico\",\n            \"state\": \"CA\",\n            \"GPS\": \"39.739068,-121.836936\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019ca3.jpg\"\n        },\n        {\n            \"bonusCode\": \"CA4\",\n            \"category\": \"TOH\",\n            \"name\": \"All-Veterans Plaza Memorial\",\n            \"value\": 1,\n            \"address\": \"305 W Pine St.\",\n            \"city\": \"Lodi\",\n            \"state\": \"CA\",\n            \"GPS\": \"38.134421, -121.276395\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"El Pazcifico Mexican Grill & Cantina just up the street at 114 W Pine St. The cantina offers authentic Mexican food, great margaritas, but best of all, best customer service in town.\",\n            \"imageName\": \"2019ca4.jpg\"\n        },\n        {\n            \"bonusCode\": \"CA5\",\n            \"category\": \"TOH\",\n            \"name\": \"Merchant Marine Memorial\",\n            \"value\": 1,\n            \"address\": \"Civic Center Dr & Ave of the Flags\",\n            \"city\": \"San Rafael\",\n            \"state\": \"CA\",\n            \"GPS\": \"38.001129, -122.535360\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The SS Jeremiah O\'Brien, located in San Francisco, is one of two remaining fully functional Liberty ships of the 2,710 built and launched during World War II. The O\'Brien has the distinction of being the last unaltered Liberty ship and remains historically accurate. Moored at Pier 45, Fisherman\'s Wharf, she is a premier San Francisco attraction. https://www.ssjeremiahobrien.org\",\n            \"imageName\": \"2019ca5.jpg\"\n        },\n        {\n            \"bonusCode\": \"CA7\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 108\",\n            \"value\": 1,\n            \"address\": \"11401 American Legion Dr.\",\n            \"city\": \"Sutter Creek\",\n            \"state\": \"CA\",\n            \"GPS\": \"38.375297, -120.800838\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Sutter Creek (est. 1854) calls itself âThe Jewel of the Motherlodeâ and for good reason. This gold country small town is typical of many in these parts and youâre bound to see many motorcyclists riding some of the best motorcycle roads in the country!\",\n            \"imageName\": \"2019ca7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS15\",\n            \"category\": \"War Dogs\",\n            \"name\": \"Service Dog Memorial\",\n            \"value\": 1,\n            \"address\": \"580 McIntyre St\",\n            \"city\": \"Golden\",\n            \"state\": \"CO\",\n            \"GPS\": \"39.724547, -105.173839\",\n            \"Access\": \"\",\n            \"flavor\": \"Foothills Animal Shelter\\nhttps://goo.gl/8WC8Cr\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019dogs15.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOGS16\",\n            \"category\": \"War Dogs\",\n            \"name\": \"K9 \'Jax\' Memorial\",\n            \"value\": 1,\n            \"address\": \"100 Perry St.\",\n            \"city\": \"Castle Rock\",\n            \"state\": \"CO\",\n            \"GPS\": \"39.37