st and 1,561 miles to New York in the east, inspiring a 1939 Saturday Evening Post cover showing two cars, starting in Kinsley and going in opposite directions, both bearing a sign saying, \\\"World\'s Fair or Bust.\\\" In 1939, there were two \\\"World\'s Fairs\\\": an eponymous one in New York, and the Golden Gate Exposition in San Francisco. The sign is in a nice park just down the street, along with a nice locomotive.\",\n            \"imageName\": \"2019ks2.jpg\"\n        },\n        {\n            \"bonusCode\": \"KS3\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial Garden\",\n            \"value\": 1,\n            \"address\": \"Bertrand Park\",\n            \"city\": \"Oakley\",\n            \"state\": \"KS\",\n            \"GPS\": \"39.12958, -100.86195\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Logan County World War I Memorial and Oakley KS EMV Doughboy are at the NW corner of E 2nd St. and Hudson Ave.\",\n            \"imageName\": \"2019ks3.jpg\"\n        },\n        {\n            \"bonusCode\": \"KS4\",\n            \"category\": \"TOH\",\n            \"name\": \"Four Chaplains Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial Park\",\n            \"city\": \"Olathe\",\n            \"state\": \"KS\",\n            \"GPS\": \"38.86856, -94.81703\",\n            \"Access\": \"24/7 Use parking lot on S. Harrison St. Paved path to the memorial.\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madei