Nr. Lumber St. and Broadway\",\n            \"city\": \"Beattyville\",\n            \"state\": \"KY\",\n            \"GPS\": \"37.572917, -83.706750\",\n            \"Access\": \"24/7. Slight uphill walk (two photos required). Parking is below the hillside in front of a mural. Just north of the railroad tracks.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: You can visit the Three Forks Historical Center, a neat museum located at CS-1065. The recently added Veteran Hall is probably the most impressive section of the museum where youâll find a nice combination of graphics, wartime posters, photos, badges and even uniforms. Each uniform has a name attached to it and was donated by that solders family, bringing home the reality of war. Thereâs also a caboose for those collecting AULDR sites. Itâs well worth a stop and converse with the local folks.\",\n            \"imageName\": \"2019ky1.jpg\"\n        },\n        {\n            \"bonusCode\": \"KY2\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Logan E. Clark Post 217\",\n            \"value\": 1,\n            \"address\": \"Nr. 1370 US 60\",\n            \"city\": \"Burna\",\n            \"state\": \"KY\",\n            \"GPS\": \"37.231323, -88.377843\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: If youâre traveling east of the Post, in the town of Marion, visit the Front Porch Restaurant at 914 S Main St. This home-owned restaurant serves their famous catfish and seafood selections. Don\'t miss out on the complimentary bowl of white beans, red tomato relish, hush puppies and cornbread!\",\n            \"imageName\": \"2019ky2.jpg\"\n        },\n        {\n            \"bonusCode\": \"KY3\",\n            \"category\": \"TOH\",\n            \"name\": \"Armed Forces Memorial\",\n            \"value\": 1,\n            \"address\": \"Devou Park\",\n            \"city\": \"Covington\",\n            \"state\": \"KY\",\n            \"GPS\": \"39.080394, -84.535262\",\n            \"Access\": \"Dawn to dusk\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: For a bite to eat, visit the Cock & Bull Public House (601 Main St,) serving English pub fare mixed with American food varieties.\",\n            \"imageName\": \"2019ky3.jpg\"\n        },\n        {\n            \"bonusCode\": \"KY4\",\n            \"category\": \"TOH\",\n            \"name\": \"Vietnam Veterans Memorial Wall\",\n            \"value\": 1,\n            \"address\": \"Elizabethtown Nature Park\",\n            \"city\": \"Elizabethtown\",\n            \"state\": \"KY\",\n            \"GPS\": \"37.736155, -85.873735\",\n            \"Access\": \"Dawn to dusk\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo veri