\"MT\",\n            \"GPS\": \"48.207975, -106.640968\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Glasgow is located just north of the Fort Peck Reservoir, a large manmade lake created by the worldâs largest (at the time) earth filled dam on the Missouri River. This dam and reservoir was created as part of the 1930s New Deal program reshaping the region and continues to provide electrical power and flood control.\",\n            \"imageName\": \"2019mt3.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"1st St. and 3rd Ave.\",\n            \"city\": \"Havre\",\n            \"state\": \"MT\",\n            \"GPS\": \"48.553466, -109.678070\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Take a photo similar to the one above, along with rider flag and motorcycle. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Havre is 40 miles south of the Canadian border and is known as being on the âHi-Line,â Burlington-Northernâs term for the 200-mile northernmost stretch of track in the U.S. Besides the railroad, beef and wheat are the main economy, now being replaced by wineries and breweries.\",\n            \"imageName\": \"2019mt4.jpg\"\n        },\n        {\n            \"bonusCode\": \"MT5\",\n            \"category\": \"TOH\",\n            \"name\": \"Vietnam and Desert Storm Memorial\",\n            \"value\": 1,\n            \"address\": \"35 S 1st St. E\",\n            \"city\": \"Malt