       \"GPS\": \"34.457924,-78.109528\",\n            \"Access\": \"\",\n            \"flavor\": \"NB\\nhttps://www.nps.gov/mocr/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks107.jpg\"\n        },\n        {\n            \"bonusCode\": \"PARKS160\",\n            \"category\": \"Parks\",\n            \"name\": \"Wright Brothers MEM\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Kill Devil Hills\",\n            \"state\": \"NC\",\n            \"GPS\": \"36.020492,-75.667451\",\n            \"Access\": \"\",\n            \"flavor\": \"MEM\\nhttps://www.nps.gov/wrbr/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks160.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial Park\",\n            \"city\": \"Ayden\",\n            \"state\": \"NC\",\n            \"GPS\": \"35.471542, -77.423665\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"One of the most famous BBQ restaurants, in a state full of famous BBQ restaurants, can be found in Ayden. That restaurant is Skylight Inn BBQ, located 1.2 miles from the memorial, at 4618 S Lee St. Skylight Inn (also known as Pete Jonesâ BBQ) has been cooking whole hogs over wood since 1947 and is one of 20 restaurants on the North Carolina Barbecue Societyâs Historic BBQ TrailÂ®. Skylight Inn was awarded the prestigious James Beard \\\"America\'s Classics\\\" Award, considered by many to be âthe Oscars for culinary arts.â Donât pass up the opportunity to stop in for some mouthwatering BBQ from Skylight Inn.\",\n            \"imageName\": \"2019nc1.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Park\",\n            \"value\": 1,\n            \"address\": \"462 Tsali Blvd.\",\n            \"city\": \"Cherokee\",\n            \"state\": \"NC\",\n            \"GPS\": \"35.482587, -83.317575\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just up the road, at 840 Tsali Blvd., you will find BJâs Diner. BJâs is an unassuming, walk-up restaurant with picnic tables and great burgers. Drop in for a delicious bite to eat, overlooking the Oconaluftee River.\",\n            \"imageName\": \"2019nc2.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Veterans Memorial Park\",\n            \"city\": \"Coinjock\",\n            \"state\": \"NC\",\n            \"GPS\": \"36.347063, -75.950963\",\n            \"Access\": \"Daily, 8am-sunset\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"In North Carolina, BBQ is taken seriously! While youâre in this part of the state, you might as well check out one of the best in Northeastern North Carolina: Currituck BBQ Company (https://currituckbbq.com). Located at 4467 Caratoke Hwy in Barco, itâs just one mile north of Veterans Memorial Park.\",\n            \"imageName\": \"2019nc3.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"1504 Tiney Rd.\",\n            \"city\": \"Ellenboro\",\n            \"state\": \"NC\",\n            \"GPS\": \"35.360103, -81.786228\",\n            \"Access\": \"24/7, this is a private memorial with no lighting, so daylight hours are recommended. (see more Notes below).\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019nc4.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC5\",\n            \"category\": \"TOH\",\n            \"name\": \"Howitzer Motor Carriage\",\n            \"value\": 1,\n            \"address\": \"American Legion Post 81\",\n            \"city\": \"Liberty\",\n            \"state\": \"NC\",\n            \"GPS\": \"35.844214, -79.566363\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While in the area, you might as well take a spin down Old Liberty Road to the north of here, running from Asheboro to Liberty. It may not be in the NC mountains, but it still has lots of elevation changes, with a number of curves that can sneak up on you, as well as several one-lane bridges. Whether you choose to take it into town, or out of town (or both), it is an excellent motorcycle road.\",\n            \"imageName\": \"2019nc5.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC6\",\n            \"category\": \"TOH\",\n            \"name\": \"Missiles and More Museum\",\n            \"value\": 1,\n            \"address\": \"720 Channel Blvd.\",\n            \"city\": \"Topsail Beach\",\n            \"state\": \"NC\",\n            \"GPS\": \"34.367352, -77.629747\",\n            \"Access\": \"24/7 for exterior photo.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"One of the best restaurants in the area, Beach Shop & Grill, is located just a few blocks away, at 701 S Anderson Blvd. If youâre lucky enough to visit on a day when they are serving their homemade clam chowder, you are in for treat. Visit http://beachshopandgrill.com for operating hours.\",\n            \"imageName\": \"2019nc6.jpg\"\n        },\n        {\n            \"bonusCode\": \"NC7\",\n            \"category\": \"TOH\",\n            \"name\": \"Gold Star Families Memorial Monument\",\n            \"value\": 1,\n            \"address\": \"Hugh MacRae Park\",\n            \"city\": \"Wilmington\",\n            \"state\": \"NC\",\n            \"GPS\": \"34.205291, -77.886549\",\n            \"Access\": \"8am-10pm daily.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"You can always find a BBQ restaurant in North Carolina, but this place is unique. Mission BBQ is a chain that strives every day to remind everyone what makes our country greatâits heroes. At Mission BBQ, they also give back by supporting local and national charities, including USO, Special Operations Warrior Foundation, Semper Fi Fund, Navy Seal Foundation, Wreaths Across America, Honor Flight America, and National Fallen Firefighters Foundation. If you stop by for lunch, you might even get to witness (and participate in) the daily salute to the Stars & Stripes. Every day at noon, the National Anthem is played as employees lead the salute. Mission BBQ, 351 S College Rd #22/23.\",\n            \"imageName\": \"2019nc7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS233\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Wahpeton NEMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"Richland County Courthouse Lawn (SE Corner)\",\n            \"city\": \"Wahpeton\",\n            \"state\": \"ND\",\n            \"GPS\": \"46.26518 -96.60574\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys233.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS117\",\n            \"category\": \"Hueys\",\n            \"name\": \"0-13879 UH-1 - West Fargo\",\n            \"value\": 1,\n            \"address\": \"1351 Main Ave West\",\n            \"city\": \"West Fargo\",\n            \"state\": \"ND\",\n            \"GPS\": \"46.875758 -96.929437\",\n            \"Access\": \"\",\n            \"flavor\": \"Veterans Bldg on property of Bonanzav