.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS101\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Cherokee OK EMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"300 South Grand AVE\",\n            \"city\": \"Cherokee\",\n            \"state\": \"OK\",\n            \"GPS\": \"36.755488,-98.35675\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys101.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS102\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Granite OK EMV Sailor\",\n            \"value\": 1,\n            \"address\": \"500 North Main ST\",\n            \"city\": \"Granite\",\n            \"state\": \"OK\",\n            \"GPS\": \"34.962879,-99.381186\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys102.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS104\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Henryetta OK EMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"Corner of N. 6th and W. Main ST\",\n            \"city\": \"Henryetta\",\n            \"state\": \"OK\",\n            \"GPS\": \"35.439959,-95.98817\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys104.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS105\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Hobart OK EMV Navy\",\n            \"value\": 1,\n            \"address\": \"316 South Main ST\",\n            \"city\": \"Hobart\",\n            \"state\": \"OK\",\n            \"GPS\": \"35.025138,-99.092784\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n 