            \"category\": \"Parks\",\n            \"name\": \"Ninety Six NHS\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Ninety Six\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.147120,-82.023141\",\n            \"Access\": \"\",\n            \"flavor\": \"NHS\\nhttps://www.nps.gov/nisi/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks112.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC1\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Monument\",\n            \"value\": 1,\n            \"address\": \"226 McGee Rd.\",\n            \"city\": \"Anderson\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.534782, -82.686314\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Palmetto Distillery, in the heart of Anderson at 200 W Benson St., is the first micro-distillery in South Carolina to produce Palmetto Moonshine, South Carolinaâs first legal moonshine, and Palmetto Whiskey, South Carolinaâs Most Awarded Craft Whiskey. They also have the distinction of being the South Carolina Whiskey Distillery of the Year, as voted by the New York International Spirits Competition. All guests over 21 years of age are invited for a free tour of the craft whiskey and moonshine distillery.\",\n            \"imageName\": \"2019sc1.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC2\",\n            \"category\": \"TOH\",\n            \"name\": \"Felix âDocâ Blanchard Memorial\",\n            \"value\": 1,\n            \"address\": \"Flag Park\",\n            \"city\": \"Bishopville\",\n            \"state\": \"SC\",\n            \"GPS\": \"34.220229, -80.246154\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Within sight of the memorial is the Lee County Veterans Museum, located next to the South Carolina Cotton Museum at 121 W. Cedar Lane. The exhibits trace the history of American conflicts with artifacts and military memorabilia provided by Lee County veterans and families. A series of exhibits tell the history of six branches of the uniformed service, including a permanent exhibit honoring Lee Countyâs Medal of Honor recipient, James Davison Heriot. Special remembrances of deceased veterans are represented in the Lest We Forget section. The Lee County Veterans Museum provides quarters for the American Legion Post 29 and Veterans of Foreign Wars Post 3096. Museum hours: Monday-Friday 10am-4:30pm, Saturday 10am-4pm.\",\n            \"imageName\": \"2019sc2.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC3\",\n            \"category\": \"TOH\",\n            \"name\": \"âVikings of Denmarkâ\",\n            \"value\": 1,\n            \"address\": \"5122 Carolina Hwy.\",\n            \"city\": \"Denmark\",\n            \"state\": \"SC\",\n            \"GPS\": \"33.320648, -81.142967\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Southern Soul Restaurant 910 W Hagood St. Open Thursday-Saturday. Great reviews! Family owned business specializing in Soul food, BBQ, and more!\",\n            \"imageName\": \"2019sc3.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC4\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Appreciation Park\",\n            \"value\": 1,\n            \"address\": \"200 S Logan St.\",\n            \"city\": \"Gaffney\",\n            \"state\": \"SC\",\n            \"GPS\": \"35.072413, -81.653943\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"American Legion Post 109 and the Cherokee County Veterans Museum is located next to the Memorial. Museum is open Saturdays 9amâ11am and Sundays 2pm-4pm. Nearby Huey alert.\",\n            \"imageName\": \"2019sc4.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Cafe & Grille\",\n            \"value\": 1,\n            \"address\": \"3544 Northgate Dr.\",\n            \"city\": \"Myrtle Beach\",\n            \"state\": \"SC\",\n            \"GPS\": \"33.684935, -78.962748\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Monday-Friday 7am-2pm, Saturday 7am-12noon, Sunday closed.\",\n            \"imageName\": \"2019sc5.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC6\",\n            \"category\": \"TOH\",\n            \"name\": \"Police Memorial\",\n            \"value\": 1,\n            \"address\": \"Traveling Buoy Park\",\n            \"city\": \"Port Royal\",\n            \"state\": \"SC\",\n            \"GPS\": \"32.375297, -80.690406\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"âSmokin\' Planks Barbecueâ Restaurant at 914 Paris Ave. is just up the street from the Buoy. Picture this: itâs smelling great, but theyâre really crowded. Itâs lunchtime on Friday and Parris Island is across the river. Families are enjoying lunch with their newly graduated United States Marines! Now thatâs âMade in Americaâ!\",\n            \"imageName\": \"2019sc6.jpg\"\n        },\n        {\n            \"bonusCode\": \"SC7\",\n            \"category\": \"TOH\",\n            \"name\": \"EMS Memorial\",\n            \"value\": 1,\n            \"address\": \"1736 Old State Rd.\",\n            \"city\": \"Gaston\",\n            \"state\": \"SC\",\n            \"GPS\": \"33.806597, -80.973892\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"South Carolina Military Museum is only 18 miles away. Located in the capital city of Columbia, the South Carolina Military Museum is one of the largest National Guard museums in the country. The mission is to honor and chronicle the South Carolina citizen soldier and this State\'s martial tradition from its colonial founding in 1670 to present-day operations. Featuring an impressive collection of artifacts, displays and exhibits, the museum tells the story of the South Carolina militia, its evolution into the National Guard, and its important role today as a force multiplier for the United States Army and Air Force.\",\n            \"imageName\": \"2019sc7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS124\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Bullhead SD EMV CZ Doughboy\",\n            \"value\": 1,\n            \"address\": \"Bullhead RD and Second ST\",\n            \"city\": \"Bullhead\",\n            \"state\": \"SD\",\n            \"GPS\": \"45.768108,-101.081823\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys124.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS294\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Clark NEMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"Commercial St & 1st Ave East\",\n            \"city\": \"Clark\",\n            \"state\": \"SD\",\n            \"GPS\": \"44.87752 -97.73283\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys294.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS344\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Winner (NEMV) Doughboy\",\n            \"value\": 1,\n            \"address\": \"200 East 3rd St - Courthouse Lawn\",\n            \"city\": \"Winner\",\n            \"state\": \"SD\",\n            \"GPS\": \"43.375742, -99.85