        \"city\": \"Hot Springs\",\n            \"state\": \"SD\",\n            \"GPS\": \"43.431261, -103.477182\",\n            \"Access\": \"Dawn to dusk\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"The city of Hot Springs was developed in the 1880s as a resort community, with visitors drawn to the restorative and curative properties of its mineral springs. In 1902, local business leaders lobbied Congress to build a facility as a National Home for Disabled Volunteer Soldiers (NHDVS). In 1907, the Battle Mountain Sanitarium (500 N 5th St.) opened for its first patients, and in 1930, it was handed over to the Veterans Administration as a more general-purpose medical facility. Pay a visit if you can.\",\n            \"imageName\": \"2019sd1.jpg\"\n        },\n        {\n            \"bonusCode\": \"SD2\",\n            \"category\": \"TOH\",\n            \"name\": \"Aurora County WWII Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"401 N. Main St\",\n            \"city\": \"Plankington\",\n            \"state\": \"SD\",\n            \"GPS\": \"43.717762, -98.485220\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019sd2.jpg\"\n        },\n        {\n            \"bonusCode\": \"SD3\",\n          