    \"value\": 1,\n            \"address\": \"331 Haysi Main St.\",\n            \"city\": \"Haysi\",\n            \"state\": \"VA\",\n            \"GPS\": \"37.206631, -82.295148\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019va3.jpg\"\n        },\n        {\n            \"bonusCode\": \"VA4\",\n            \"category\": \"TOH\",\n            \"name\": \"WWI Memorial\",\n            \"value\": 1,\n            \"address\": \"9483 Kings Hwy.\",\n            \"city\": \"King George\",\n            \"state\": \"VA\",\n            \"GPS\": \"38.266160, -77.179634\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"While in King George, consider visiting the Belle Grove Plantation where President James Madison was born. Or better yet spend the night as it is a bed and breakfast. They only have a few rooms and it is pricey, but how often can you say you slept where a president was born? https://bit.ly/2MqOknP\",\n            \"imageName\": \"2019va4.jpg\"\n        },\n        {\n            \"bonusCode\": \"VA5\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"20 Town Square Rd.\",\n            \"city\": \"Lovettsville\",\n            \"state\": \"VA\",\n            \"GPS\": \"39.274693, -77.639507\",\n            \"Access\": \"24/7, two photos may be required.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"There are a number of restaurants in town including two right next to the Town Square Park. Or if wine is your thing there are two wineries nearby. https://bit.ly/2R82jzJ\",\n            \"imageName\": \"2019va5.jpg\"\n        },\n        {\n            \"bonusCode\": \"VA6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"American Legion Post 16\",\n            \"city\": \"Lynchburg\",\n            \"state\": \"VA\",\n            \"GPS\": \"37.338365, -79.223729\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Looking for something to eat? Consider the Iron and Ale at 106 Cornerstone St. with a nice menu ranging from burgers to higher-end entrees http://ironandale.com/\",\n            \"imageName\": \"2019va6.jpg\"\n        },\n        {\n            \"bonusCode\": \"VA7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"Roseland Cemetery\",\n            \"city\": \"Reedville\",\n            \"state\": \"VA\",\n            \"GP