rks\",\n            \"name\": \"San Juan Island NHP\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Friday Harbor\",\n            \"state\": \"WA\",\n            \"GPS\": \"48.464807,-123.024302\",\n            \"Access\": \"\",\n            \"flavor\": \"NHP\\nhttps://www.nps.gov/sajh/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks128.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Memorial\",\n            \"value\": 1,\n            \"address\": \"709 Broadway\",\n            \"city\": \"Colton\",\n            \"state\": \"WA\",\n            \"GPS\": \"46.568159, -117.127483\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Colton was founded in 1879 when three men were dissatisfied with the \\\"proprietor\\\" of nearby Uniontown. So what did they do? Well, the only reasonable thing, they started their own town! The location they picked proved to be good for business as it was along a route for getting grain to market and later a rail line.\",\n            \"imageName\": \"2019wa1.jpg\"\n        },\n        {\n            \"bonusCode\": \"WA2\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"316 E Crawford St.\",\n            \"city\": \"Deer Park\",\n            \"state\": \"WA\",\n            \"GPS\": \"47.95419, -117.47232\",\n            \"Access\": \"24/7, unrestricted\",\n            \"flavor\": \"Instructions: Take a photo simila