tions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Just a short ride from this memorial is the state capital of West Virginia that has numerous memorials ranging from military to the rich history of coal in the region.\",\n            \"imageName\": \"2019wv1.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV2\",\n            \"category\": \"TOH\",\n            \"name\": \"9/11 Memorial\",\n            \"value\": 1,\n            \"address\": \"Spring Hill Cemetery\",\n            \"city\": \"Huntington\",\n            \"state\": \"WV\",\n            \"GPS\": \"38.411085, -82.416854\",\n            \"Access\": \"8am to dusk\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"If youâre riding in the RTE-USA, Hillbilly Hotdogs is 11 miles north in Lesage at 6951 Ohio River Rd. Known for great dogs and all sorts of kitsch! Featured in Diners, Drive-Ins and Dives.\",\n            \"imageName\": \"2019wv2.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV3\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"Main St. and Seneca Tr.\",\n            \"city\": \"Parsons\",\n            \"state\": \"WV\",\n            \"GPS\": \"39.096338,-79.681182\",\n            \"Access\": \"24/7 with parking across the street at Sheetz.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"This tiny town holds the historic Tucker County Courthouse that holds a clock funded by moonshine and bootlegging fines. Â How small is Parsons? Even though it\'s the BIGGEST town in the county, it holds the only traffic light in the county. And the first officer killed in the civil war, General Robert S. Garnett, died in Parsons.\",\n            \"imageName\": \"2019wv3.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV4\",\n            \"category\": \"TOH\",\n            \"name\": \"War Memorial\",\n            \"value\": 1,\n            \"address\": \"63 Winchester St.\",\n            \"city\": \"Paw Paw\",\n            \"state\": \"WV\",\n            \"GPS\": \"39.534341,-78.457211\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Paw Paw was incorporated in 1891 and named for the Paw Paw fruit that grew abundantly in the area at the time. Just north of town is the Paw Paw Tunnel, an impressive piece of engineering built to allow the C&O canal get around the mountain and avoid the series of curves in the Potomac River. The tunnel is now part of the Chesapeake and Ohio Canal National Historical Park.\",\n            \"imageName\": \"2019wv4.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV5\",\n            \"category\": \"TOH\",\n            \"name\": \"Those Who Served War Museum\",\n            \"value\": 1,\n            \"address\": \"1500 W Main St.\",\n            \"city\": \"Princeton\",\n            \"state\": \"WV\",\n            \"GPS\": \"37.366353, -81.103366\",\n            \"Access\": \"Data not availalbe\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Data not available\",\n            \"imageName\": \"2019wv5.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veteran memorial\",\n            \"value\": 1,\n            \"address\": \"Pike St. and Clement St.\",\n            \"city\": \"Shinnston\",\n            \"state\": \"WV\",\n            \"GPS\": \"39.397526, -80.296874\",\n            \"Access\": \"24/7 with onsite parking\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Whether or not youâre hunting RTE-USA sites, Country Club Bakery, creator of the Pepperoni Roll, is 12 miles away, in Fairmont at 1211 Country Club Rd. If youâve never had a West Virginia Pepperoni Roll, ya gotta try one. Itâs a thing. Imagine a warm, soft, homemade, mouth watering, large roll packed with zesty slices of pepperoni. Thatâs just the beginning; now add smooth provolone cheese or spicy hot pepper cheese, and you have a quick, easy sandwich thatâs out of this world!\",\n            \"imageName\": \"2019wv6.jpg\"\n        },\n        {\n            \"bonusCode\": \"WV7\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Post 1\",\n            \"value\": 1,\n            \"address\": \"86 16th St.\",\n            \"city\": \"Wheeling\",\n            \"state\": \"WV\",\n            \"GPS\": \"40.064275, -80.718362\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached, along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to RULES 5-7 (http://www.tourofhonor.com/pages/rules.html#rules57) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"You can eat at the Post, or the Avenue Bar and Grill is 11 miles south in Moundsville at 827 Lafayette Ave. ABG is a RTE-USA Challenge location.\",\n            \"imageName\": \"2019wv7.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS157\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Rock Springs WY EMV Doughboy\",\n            \"value\": 1,\n            \"address\": \"Bunning Park, Noble DR and Evans ST\",\n            \"city\": \"Rock Springs\",\n            \"state\": \"WY\",\n            \"GPS\": \"41.589439,-109.221936\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys157.jpg\"\n        },\n        {\n            \"bonusCode\": \"DOUGHBOYS318\",\n            \"category\": \"Doughboys\",\n            \"name\": \"Evanston\",\n            \"value\": 1,\n            \"address\": \"County Courthouse Lawn - Main & 9th\",\n            \"city\": \"Evanston\",\n            \"state\": \"WY\",\n            \"GPS\": \"41.26669 -110.96492\",\n            \"Access\": \"\",\n            \"flavor\": \"\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019doughboys318.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS188\",\n            \"category\": \"Hueys\",\n            \"name\": \"69-15660 UH-1 - Casper\",\n            \"value\": 1,\n            \"address\": \"1800 Bryan Stock Trail\",\n            \"city\": \"Casper\",\n            \"state\": \"WY\",\n            \"GPS\": \"42.873916, -106.297707\",\n            \"Access\": \"\",\n            \"flavor\": \"VFW Post #9439\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys188.jpg\"\n        },\n        {\n            \"bonusCode\": \"HUEYS242\",\n            \"category\": \"Hueys\",\n            \"name\": \"65-07953 UH-1 - FE Warren AFB\",\n            \"value\": 1,\n            \"address\": \"US 87 & Randall Rd\",\n            \"city\": \"Francis E. Warren AFB*\",\n            \"state\": \"WY\",\n            \"GPS\": \"41.146593, -104.841654\",\n            \"Access\": \"\",\n            \"flavor\": \"Static Display just outside FE Warren AFB Visitors Center\\n\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019hueys242.jpg\"\n        },\n        {\n            \"bonusCode\": \"PARKS38\",\n            \"category\": \"Parks\",\n            \"name\": \"Fort Laramie NHS\",\n            \"value\": 1,\n            \"address\": \"\",\n            \"city\": \"Ft Laramie\",\n            \"state\": \"WY\",\n            \"GPS\": \"42.203687,-104.556186\",\n            \"Access\": \"\",\n            \"flavor\": \"NHS\\nhttps://www.nps.gov/fola/index.htm\",\n            \"madeinamerica\": \"\",\n            \"imageName\": \"2019parks38.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY1\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Frances E. Self Post 6\",\n            \"value\": 1,\n            \"address\": \"2001 E Lincolnway\",\n            \"city\": \"Cheyenne\",\n            \"state\": \"WY\",\n            \"GPS\": \"41.138174, -104.793871\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Cheyenne is the State Capital and largest city in Wyoming. The city began in 1867, when the Union Pacific Railroad came through on its way to the west coast.\",\n            \"imageName\": \"2019wy1.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY2\",\n            \"category\": \"TOH\",\n            \"name\": \"WWII Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"113 1st Ave. W\",\n            \"city\": \"Deaver\",\n            \"state\": \"WY\",\n            \"GPS\": \"44.891036, -108.596719\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met\",\n            \"madeinamerica\": \"Deaver is at the junction of Hwys. 310 and 114 and has a population of 178. One restaurant, M Sisters LLC, in the former Trailways building along Hwy. 310 but hours of operation are limited. No gas services available so make sure you are filled up before you head this way.\",\n            \"imageName\": \"2019wy2.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY3\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial and Howitzer\",\n            \"value\": 1,\n            \"address\": \"Grand View Park\",\n            \"city\": \"Encampment\",\n            \"state\": \"WY\",\n            \"GPS\": \"41.204856, -106.788387\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Encampment is a small Wyoming town along Hwy. 70 that was first inhabited by French-Canadian trappers in the 1800s. In 1897, copper was discovered in the mountains and growth followed. A tramway ran from the mine to Encampment a distance of 16 miles to bring the copper to the smelter. Part of the tramway is still on display at the Encampment Museum, one block south from the memorial. The museum is free and a must see if interested in the rich history of this area. Only 10 towns exist in the whole of Carbon County.\",\n            \"imageName\": \"2019wy3.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY4\",\n            \"category\": \"TOH\",\n            \"name\": \"Donald J. Ruhl MOH Memorial\",\n            \"value\": 1,\n            \"address\": \"Cemetery Rd. & County Lane 34\",\n            \"city\": \"Greybull\",\n            \"state\": \"WY\",\n            \"GPS\": \"44.495956, -108.073046\",\n            \"Access\": \"Sunrise to sunset on paved roadway to cemetery. Memorial can be viewed from outside cemetery gate if arriving after hours.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met\",\n            \"madeinamerica\": \"Greybull on Route 14, 16 and 20 between Yellowstone and the Black Hills. Greybull is a western town along the Bighorn River which allows for numerous water activities such as boating and fishing. The Greybull Museum is small but free and has numerous artifacts from wild west days and even some fossils from the local area.\",\n            \"imageName\": \"2019wy4.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY5\",\n            \"category\": \"TOH\",\n            \"name\": \"American Legion Memorial\",\n            \"value\": 1,\n            \"address\": \"Greenwood Cemetery\",\n            \"city\": \"Newcastle\",\n            \"state\": \"WY\",\n            \"GPS\": \"43.850819, -104.195261\",\n            \"Access\": \"Sunrise to Sunset on paved roadway to cemetery.\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Newcastle is an 1880âs town that has had many ups and several downs over the years. Much of the history is included in the Anna Miller Museum, which is just outside the gate of the cemetery in several 1889 buildings and is free for the visit. Newcastle has many restaurants for all types of appetites so enjoy a stop before heading out of town.\",\n            \"imageName\": \"2019wy5.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY6\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial Monument\",\n            \"value\": 1,\n            \"address\": \"American Legion Park\",\n            \"city\": \"Pinedale\",\n            \"state\": \"WY\",\n            \"GPS\": \"42.868437, -109.869551\",\n            \"Access\": \"Daylight hours, two pictures required\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourofhonor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Pinedale, is a mountain town on the Centennial Scenic Byway at the base of the majestic Wind River Mountain Range. Wildlife outnumber residents ten-fold and animals are commonly seen any day of the year. There are resident moose found in town parks, and mule deer cautiously make their way across streets and driveways. Mountain lions and bobcats have been spotted sunning on rocks, and gray wolves and elk herds can be seen loping alongside fences near wilderness areas.\",\n            \"imageName\": \"2019wy6.jpg\"\n        },\n        {\n            \"bonusCode\": \"WY7\",\n            \"category\": \"TOH\",\n            \"name\": \"Veterans Memorial\",\n            \"value\": 1,\n            \"address\": \"436 2nd St.\",\n            \"city\": \"Ten Sleep\",\n            \"state\": \"WY\",\n            \"GPS\": \"44.033941, -107.444685\",\n            \"Access\": \"24/7\",\n            \"flavor\": \"Instructions: Take a photo similar to the one attached along with rider flag and motorcycle. A second photo may be required for location and/or safety reasons. Refer to Rules 5-7 (http://www.tourof honor.com/pages/rules.html#rules5-7) for photo verification. Scorers have final say whether standards are met.\",\n            \"madeinamerica\": \"Made In America: Ten Sleep is an All American City located along one of the most beautiful highways you could find, Hwy. 16.\",\n            \"imageName\": \"2019wy7.jpg\"\n        }\n    ]\n}', '19.4.1');
